INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(59292, 'ptBR', 'Recompensa da conquista', '', '', '', '', '', '', '', '', 32750),
(59291, 'ptBR', 'Recompensa da conquista', '', '', '', '', '', '', '', '', 32750),
(58089, 'ptBR', 'Teste de missão', '', 'Uma missão!', '', '', '', '', '', '', 32750),
(57917, 'ptBR', '[DNT] Test - JAM', '', '', '', '', '', '', '', '', 32750),
(57853, 'ptBR', 'Equipe Forjada em Batalha', '', '', '', '', '', '', '', '', 32750),
(57852, 'ptBR', 'Aventura de Masmorra', '', '', '', '', '', '', '', '', 32750),
(57850, 'ptBR', 'Parcerias Renomadas', '', '', '', '', '', '', '', '', 32750),
(57731, 'ptBR', 'Unidade retalhadora portátil do Borogodó', 'O Mestre Engenheiro Borogodó pediu o seguinte material:$B$B*30 Barras de Tório.$B$B*50 Barras de Mithril.$B$B*75 Barras de Ferro.$B$B*1 Serra a Vapor.', 'Estou tão ansioso quanto você para testar minha unidade retalhadora portátil, $r, mas para que eu possa preparar o kit, vou precisar de matéria-prima — muita matéria-prima!$B$BPara ser mais exato, vou precisar de uma MONTANHA de tório, mithril e ferro. Também quero uma serra a vapor para cada unidade. Essas serras você acha lá no acampamento madeireiro dos Lobo do Gelo.$B$BUma vez, quando eu estava bisbilhotando por ali — antes de ser capturado —, notei que havia um montão de serras a vapor lá naquela serraria.', '', '', '', '', '', '', 32750),
(57730, 'ptBR', 'Unidade retalhadora portátil do Borogodó', 'O Mestre Engenheiro Borogodó pediu o seguinte material:$B$B*30 Barras de Tório.$B$B*50 Barras de Mithril.$B$B*75 Barras de Ferro.$B$B*1 Serra a Vapor.', 'Estou tão ansioso quanto você para testar minha unidade retalhadora portátil, $r, mas para que eu possa preparar o kit, vou precisar de matéria-prima — muita matéria-prima!$B$BPara ser mais exato, vou precisar de uma MONTANHA de tório, mithril e ferro. Também quero uma serra a vapor para cada unidade. Essas serras você acha lá no acampamento madeireiro dos Lobo do Gelo.$B$BUma vez, quando eu estava bisbilhotando por ali (antes de ser capturado), notei que havia um montão de serras a vapor lá naquela serraria.', '', '', '', '', '', '', 32750),
(57723, 'ptBR', 'Estábulos vazios', 'Localize um Lobo do Gelo no Vale Alterac. Use a Focinheira de Lobo do Gelo para \"domar\" a fera. Uma vez domado, o Lobo do Gelo seguirá você até o Mestre de Estábulo dos Lobo do Gelo. Fale com o Mestre de Estábulo para conseguir crédito pela captura.', 'A guerra no vale custou a vida de muitos dos nossos soldados. Precisamos dar novo ânimo às nossas tropas!$B$BSe pudermos abastecer nossos estábulos, os Cavalga-lobos poderão uma vez mais cavalgar até o campo de batalha.$B$BPegue esta focinheira e vá caçar os lobos do gelo que vagueiam pela floresta. Use a focinheira para domar a fera, e traga-a para mim. E, assim, vamos reabastecer os estábulos.$B$BQuando tivermos lobos em quantidade suficiente, os Cavalga-lobos voltarão a patrulhar nossas linhas de frente.', 'Lobo do gelo domado e entregue', '', '', '', '', 'Fale novamente com o Mestre de Estábulo dos Lobo do Gelo no Vale Alterac.', 32750),
(57722, 'ptBR', 'Estábulos vazios', 'Encontre um Carneiro de Alterac, no Vale Alterac. Use a Coleira de Treinamento de Lançatroz no Carneiro de Alterac para \"domar\" a fera. Uma vez domado, o Carneiro de Alterac seguirá você até o Mestre dos Estábulos. Fale com o Mestre dos Estábulos para conseguir crédito pela captura.', 'Olhe para nossos estábulos, $n! A Brigada Lançatroz não tem carneiros para montar, nossa cavalaria está incapacitada.$B$BVocê tem que nos ajudar, soldado. Pegue esta coleira de treinamento e siga para o ermo, aqui no vale. Encontre os carneiros de Alterac que vagueiam pela área e use a coleira pra capturar um. Então, traga-o para mim, e eu o colocarei no nosso estábulo.$B$BQuando tivermos carneiros em número suficiente, o comandante dos Cavalga-carneiros será notificado. Com sua ajuda, a cavalaria renascerá!', 'Carneiro encoleirado e entregue', '', '', '', '', 'Fale novamente com o Mestre de Estábulo de Lançatroz em Dun Baldar, que fica no Vale Alterac.', 32750),
(57686, 'ptBR', 'O Viajante Eterno', 'Colete Ecos da Mortalidade de criaturas vivas.', 'Salve, mortal.\n\nPor incontáveis eras meu povo singrou a miríade dos reinos da realidade, testemunhando fenômenos que você não conseguiria sequer começar a compreender. Mesmo assim, você tem muito a aprender sobre o que $Go:a; aguarda no horizonte.\n\nO poder da Morte está aumentando. O véu entre nosso mundo e as Terras Sombrias enfraquece.\n\nQuando uma vida mortal se extingue, um eco subsiste. Os mortais mais poderosos deixam os ecos mais ressoantes.\n\nTraga-os para mim para que eu possa estudá-los... para nosso mútuo benefício.', '', '', '', '', '', '', 32750),
(57670, 'ptBR', 'Mas que a-belha colheita', 'Leve o Mel Flor do Mar Coletado a Buque, o \"Tinhoso\", em Brennadam.', '<Agora que a sua coletora amadureceu, a colmeia Meleira está criando mais mel.\n\nCertamente tem alguém em Brennadam que encontrará utilidade para esse mel.>', '', '', '', '', '', 'Leve o Mel Flor do Mar Coletado a Buque, o \"Tinhoso\", em Brennadam.', 32750),
(57643, 'ptBR', 'Um presente chacoalhado gentilmente', '', '', '', '', '', '', '', '', 32750),
(57642, 'ptBR', 'Um presente de Véu de Inverno', '', '', '', '', '', '', '', '', 32750),
(57641, 'ptBR', 'Olho-que-tudo-vê do Mestre Rúben', 'Recupere o Olho-que-tudo-vê do Mestre Rúben nas cavernas dos Invernacha e leve-o para o Mestre Rúben.$B$BCuidado: dizem que o Olho-que-tudo-vê do Mestre Rúben carrega uma terrível maldição!', 'Sua guerra no coração de Alterac nada significa para a Camarilha, $c. Nós faremos o que sempre fizemos: esperar que um vitorioso surja das cinzas e destroços de toda essa loucura. Só então atacaremos.$B$BNo entanto, não é pra isso que estamos aqui agora. O Olho-que-tudo-vê foi perdido, levado pelos trolls Invernacha da região.$B$BRecupere o Olho e nossos serviços estarão à sua disposição pelo tempo que o seu lado ainda tiver.$B$BFale novamente comigo quando recuperar o Olho, para que eu possa examinar você.$B$B<O Mestre Rúben sorri.>', 'Olho-que-tudo-vê do Mestre Rúben Recuperado', '', '', '', '', 'Fale novamente com Mestre da Camarilha Rúben no Vale Alterac.', 32750),
(57640, 'ptBR', 'Olho-que-tudo-vê do Mestre Rúben', 'Recupere o Olho-que-tudo-vê do Mestre Rúben nas cavernas dos Invernacha e leve-o para o Mestre Rúben.$B$BCuidado: dizem que o Olho-que-tudo-vê do Mestre Rúben carrega uma terrível maldição!', 'Sua guerra no coração de Alterac nada significa para a Camarilha, $c. Nós faremos o que sempre fizemos: esperar que um vitorioso surja das cinzas e destroços de toda essa loucura. Só então atacaremos.$B$BNo entanto, não é pra isso que estamos aqui agora. O Olho-que-tudo-vê foi perdido, levado pelos trolls Invernacha da região.$B$BRecupere o Olho, e nossos serviços estarão à sua disposição pelo tempo que o seu lado ainda tiver.$B$BFale novamente comigo quando recuperar o Olho, para que eu possa examinar você.$B$B<O Mestre Rúben sorri.>', 'Olho-que-tudo-vê do Mestre Rúben Recuperado', '', '', '', '', 'Fale novamente com Mestre da Camarilha Rúben no Vale Alterac.', 32750),
(57639, 'ptBR', 'A Lenda de Korrak', 'De acordo com a lenda, o líder dos poderosos trolls Invernacha aparece esporadicamente para trazer destruição e caos aos moradores do Vale Alterac.$B$BSe Korrak aparecer, destrua-o e fale novamente com o Mestre Guerreiro Laggrond.', 'Os Lançatroz invasores não são a única ameaça da região, soldado. A guerra no Vale é travada em duas frentes. Os trolls canibais Invernacha também disputam o poder.$B$BEles são liderados por Korrak, o Sanguinário, uma fera cruel e sanguinária.$B$BUm ataque a Korrak com certeza incapacitaria o clã Invernacha. Mate a fera e seja $grecompensado:recompensada;!', '', '', '', '', '', '', 32750),
(57638, 'ptBR', 'Korrak, o Sanguinário', 'De acordo com a lenda, o líder dos poderosos trolls Invernacha aparece quando bem entende para trazer destruição e caos aos moradores do Vale Alterac.$B$BSe Korrak aparecer, mate-o e fale novamente com o Tenente Haggerdin em Dun Baldar.', 'Os trolls Invernacha da região são selvagens cruéis que adorariam incluir os nossos ossos nos seus ensopados fétidos.$B$BPrecisamos mostrar nosso poder!$B$BNós encontramos, nas cavernas, alguns livros que detalham como é a hierarquia dos trolls. Os artefatos indicam que o líder deles, Korrak, o Sanguinário, tende a ficar escondido até ter uma boa razão para mostrar as fuças.$B$BA morte de Korrak significaria a morte do clã Invernacha! Mate Korrak e volte aqui.', '', '', '', '', '', '', 32750),
(57637, 'ptBR', 'Distúrbio Detectado: Terras do Fogo', 'Reviva o cerco às Terras do Fogo.', 'Você chegou cedo, $n. Eu não tinha nem mandado chamar você ainda.\n\nSurgiu outro distúrbio temporal, dessa vez nas Terras do Fogo. Se Ragnaros não tivesse sido detido naquele momento, bem, você já viu um dos cursos que o tempo poderia seguir.\n\nPode ser necessária uma cronomancia intrincada para que você pegue Ragnaros no início do desvio, mas depois do que quer que tenha causado o distúrbio. Quem quer que esteja fazendo isso está jogando pesado.', '', '', '', '', '', '', 32750),
(57581, 'ptBR', 'De pena em pena', '', '', '', '', '', '', '', '', 32750),
(57322, 'ptBR', 'Suprimentos dos Ferrofundo', 'Leve 10 Suprimentos dos Ferrofundo para o Intendente da Horda na Bastilha Lobo do Gelo.', 'Os anões Lançatroz estão usando a mina Ferrofundo como depósito. Quero que você saqueie essa mina e me traga os suprimentos de lá. Isso enfraquecerá as atividades dos Lançatroz no Vale Alterac, e nos dará o equipamento de que tanto precisamos!$B$BTome cuidado, $n. A mina Ferrofundo fica bem dentro do território da Aliança, e o controle da mina muda tanto quanto as neves do vale.', '', '', '', '', '', '', 32750),
(57321, 'ptBR', 'Suprimentos de Dentefrio', 'Leve 10 Suprimentos de Dentefrio para o Intendente da Horda na Bastilha Lobo do Gelo.', 'A mina dos Dentefrio, ao norte daqui, já foi um lugar ideal para estocar suprimentos, mas agora, com as lutas contra os Lançatroz ficando tão renhidas, já não temos guerreiros suficientes para protegê-la. Assim, o controle da mina costuma ficar com a Aliança ou com os habitantes dos subterrâneos...$B$BMas ainda precisamos dos suprimentos, $n! Vá até a mina Dentefrio e me traga quanto puder carregar. E cuidado com os inimigos quando for pra lá. Os rumos da batalha mudam constantemente naquele lugar...', '', '', '', '', '', '', 32750),
(57318, 'ptBR', 'Mais espólios!', '', '', '', '', '', '', '', '', 32750),
(57317, 'ptBR', 'Espólios dos inimigos', 'Leve 20 Sobras de Armadura para o Ferreiro Regzar na Aldeia Lobo do Gelo.', 'Ao lutar com o inimigo, colete sobras de armaduras e traga-as para mim. Eu usarei esses restos para fazer armaduras para nossas tropas!', '', '', '', '', '', '', 32750),
(57315, 'ptBR', 'Torres e casamatas', 'Capture uma torre ou casamata inimiga e então apresente-se à Cabo Tika Rosnassangue na Aldeia Lobo do Gelo.', 'Torres e casamatas são posições defensivas importantes, e precisamos controlar tantas quanto pudermos! Quero que você ataque uma casamata controlada pelo inimigo.$B$BBasta entrar numa casamata que tenha um estandarte da Aliança fincado. Lá dentro você encontrará outro estandarte inimigo. Arranque-o, e um estandarte branco da Horda aparecerá. Muito bem!$B$BAo fazer isso, sua missão estará cumprida, mas, se puder manter a torre sob seu controle por tempo suficiente, e a Aliança não retomá-la de você, então ela será destruída!', '', '', '', '', '', '', 32750),
(57314, 'ptBR', 'Capture uma mina', 'Capture uma mina e, a seguir, apresente-se à Cabo Tika Rosnassangue na Aldeia Lobo do Gelo.', 'A batalha grassa por todo o Vale Alterac, e também nas minas Dentefrio e Ferrofundo. Ambas são ricas fontes de minério e ambas são usadas para estocar suprimentos. Não é por acaso que são tão disputadas!$B$BAjude nosso esforço de guerra, $n! Capture uma das minas para a Horda! Para isso, entre em uma mina que ainda não controlamos e mate o líder deles lá. Quando você completar a missão a mina será nossa e enviaremos tropas para protegê-la!', '', '', '', '', '', '', 32750),
(57313, 'ptBR', 'Fale com nosso Intendente', 'Fale com o Intendente dos Lobo do Gelo.', '$n, o Intendente dos Lobo do Gelo está à procura de recrutas para algumas missões nas minas do Vale Alterac. Fale com ele para obter mais informações.$B$BSiga a estrada para oeste até a casamata e então tome a saída oeste. Não tem como errar.', '', '', '', '', '', '', 32750),
(57312, 'ptBR', 'Os cemitérios de Alterac', 'Ataque um cemitério e depois apresente-se à Cabo Tika Rosnassangue na Aldeia Lobo do Gelo.', 'As frentes de batalha do Vale Alterac estão sempre mudando. Os territórios mudam de posse continuamente, à medida que enfrentamos nossos oponentes em combate mortal. E os cemitérios, $n, são onde as batalhas$B$BQuero que você ataque um cemitério da Aliança! Encontre um cemitério com um estandarte da Aliança e arranque-o do chão.$B$BBasta isso para cumprir a tarefa, mas... se você mantiver o domínio do cemitério por alguns minutos, ele será nosso e você receberá reforços para $Gajudá-lo:ajudá-la;.', '', '', '', '', '', '', 32750),
(57311, 'ptBR', 'Suprimentos de Dentefrio', 'Leve 10 Suprimentos de Dentefrio para o Intendente da Aliança em Dun Baldar.', 'A mina Dentefrio funciona como depósito para a Horda. A comida que eles fornecem para as tropas, o estado das armas e armaduras deles... é tudo muito ruim! Mas... em horas como essa, em que suprimentos são tão importantes, temos que usar o que está disponível.$B$BEntre na mina dos Dentefrio e me traga os suprimentos deles. Isso vai ajudar a Aliança a continuar lutando, e vai tirar muitos equipamentos das mãos dos guerreiros da Horda.$B$BBoa sorte, $n. A mina fica bem ao sul, bem dentro do território da Horda.', '', '', '', '', '', '', 32750),
(57310, 'ptBR', 'Suprimentos dos Ferrofundo', 'Leve 10 Suprimentos dos Ferrofundo para o Intendente da Aliança em Dun Baldar.', 'Antes que a luta começasse, nós estocamos suprimentos para Dun Baldar na mina Ferrofundo. Os troggs que apareceram por lá não davam muito trabalho quando tínhamos tropas sobrando para guardar a mina. Mas agora, lutando com a Horda, está ficando difícil manter o controle de Ferrofundo.$B$BPrecisamos dos suprimentos dessa mina, $n. Entre lá e me traga suprimentos!', '', '', '', '', '', '', 32750),
(57307, 'ptBR', 'Torres e casamatas', 'Destrua o estandarte em uma torre ou casamata inimiga, e então fale novamente com o Sargento Durgen Lançatroz em Dun Baldar.', 'Torres e casamatas são posições defensivas críticas, e por isso precisamos controlar tantas quanto pudermos! Quero que você ataque uma torre ou casamata no Vale Alterac.$B$BPara isso, basta entrar numa torre que tenha um estandarte da Horda fincado no topo. Lá dentro você encontrará outro estandarte inimigo. Arranque o estandarte, e um estandarte branco da Aliança aparecerá. Muito bem!$B$BAo fazer isso, sua missão estará cumprida, mas se você puder manter a torre sob seu controle por tempo suficiente, e a Horda não retomá-la de você, então ela será destruída!', '', '', '', '', '', '', 32750),
(57306, 'ptBR', 'Mais sobras de armadura', '', '', '', '', '', '', '', '', 32750),
(57305, 'ptBR', 'Sobras de Armadura', 'Leve 20 Sobras de Armadura para Murgot Baixaforja em Dun Baldar.', 'As batalhas irrompem sem cessar no Vale Alterac, e os suprimentos que recebemos de Altaforja não são suficientes para equipar nossas tropas de veteranos.$B$BSe você encontrar sobras no campo de batalha, ajude com os esforços de guerra e traga-as para mim!', '', '', '', '', '', '', 32750),
(57304, 'ptBR', 'Capture uma mina', 'Capture uma mina não controlada pelos Lançatroz e, a seguir, apresente-se ao Sargento Durgen Lançatroz nas Montanhas de Alterac.', 'As minas do Vale Alterac guardam mais que apenas simples minério. Os Lobo do Gelo e os Lançatroz estocaram os excessos de suprimentos nas minas Ferrofundo e Dentefrio. Não foi uma má ideia, mas agora precisamos manter o controle das minas!$B$BCapture uma mina e então volte a falar comigo. Para tanto, basta entrar em uma mina que ainda não capturamos e matar o líder de lá. Quando fizer isso, a mina passará para o seu controle, e enviaremos tropas para protegê-la!', '', '', '', '', '', '', 32750),
(57303, 'ptBR', 'O Intendente', 'Fale com o Intendente de Lançatroz.', '$n, nosso intendente me encarregou de enviar os novos recrutas para ele. Ele precisa dos suprimentos estocados nas minas de Alterac, e provavelmente vai mandar você pra lá para buscá-los.$B$BSiga a estrada. Você encontrará o intendente na direção oeste.', '', '', '', '', '', '', 32750),
(57302, 'ptBR', 'Cemitérios do Vale Alterac', 'Ataque um cemitério e, então, apresente-se ao Sargento Durgen Lançatroz em Dun Baldar.', 'Os cemitérios do Vale Alterac são territórios disputados. A Horda e a Aliança lutam selvagemente por esses campos sagrados. $n, você está $gdisposto:disposta; a se unir à luta?$B$BQuero que você ataque um cemitério inimigo. Encontre um cemitério com um estandarte da Horda fincado e arranque-o do chão! Basta fazer isso e sua tarefa estará concluída...$B$BMas se você também puder manter o cemitério sob seu domínio por alguns minutos, logo nossas tropas aparecerão para ajudar você.', '', '', '', '', '', '', 32750),
(57300, 'ptBR', 'Soldado temporal', 'Ganhe 500 de Honra na Revanche de Korrak.', 'Era uma vez uma terra conhecida como Vale Alterac, que era objeto de uma disputa acalorada entre a Horda e a Aliança.\n\nBem, na verdade essa batalha nunca acabou, mas vamos dar uma olhada em como tudo começou...', '', '', '', '', '', '', 32750),
(57298, 'ptBR', 'O que aconteceu \"de verdade\"...', 'Embarque com Crona nas Cavernas do Tempo para derrotar os vilões do passado.', 'Você chegou longe depois de todos esses anos, $n.\n\nDo começo humilde fazendo bicos à salvação da existência de toda Azeroth, você fez muito para garantir a segurança do nosso mundo.\n\nMas para que ficarmos aqui de bobeira tentando lembrar coisas? Vamos voltar no tempo e reviver todos os pedaços empolgantes tudo de novo! \n\nNão se preocupe, em todos os milhões e mais milhões de percursos temporais, eu sei que a gente vai achar um em que você nunca morreu.', '', '', '', '', '', '', 32750),
(57249, 'ptBR', 'Um convite no tempo certo', 'Entregue o Convite dos Andarilhos do Tempo a Crona nas Cavernas do Tempo.', 'Chegou a hora de relembrar o passado e celebrar nossas aventuras por Azeroth e além. \n\nPara comemorar a ocasião, a Revoada Dragônica Bronze vai fazer uma festança, e você está convidad$Go:a;! \n\nVenha para as Cavernas do Tempo e apresente este convite para entrar na festa!', '', '', '', '', '', '', 32750),
(57198, 'ptBR', 'Senso de obrigação', 'Espione a reunião de Jaina Proudmore.', 'Derek está livre. Tenho muito pelo que me redimir com ele.\n\nDizem que haverá uma reunião entre Jaina e o irmão.\n\nSiga para a Aldeia Brisa do Mar no Vale Trovamare. Espero que lá você possa descobrir... bem, digamos que estou tentando me concentrar no quadro geral.\n\nSe você descobrisse alguma coisa interessante, eu ficaria muito grata.\n\nPor enquanto, guardemos tudo cá entre nós.', '', '', '', '', '', 'Fale novamente com Lilian Voss com seu relatório.', 32750),
(57152, 'ptBR', 'Mais leal', 'Fale com Sylvana Correventos.', 'A Dama Sombria já havia antecipado essa possibilidade. Ela preparou um plano de contingência para lidar com a situação.\n\nVá ter com ela na Terra Fantasma. Pegue essa pedra de regresso, tem energia para mais um uso. \n\nEla se encontrará com você perto do Pico dos Correventos.', '', '', '', '', '', '', 32750),
(57151, 'ptBR', 'Uma linha na areia', 'Fale com Nathanos.', 'Agora que colocamos ordem em casa, é hora de limpar o lixo que ficou no portão.\n\nQue gentileza dos traidores, se reunirem num mesmo lugar para serem abatidos de uma só vez.\n\nVamos acabar de uma vez por todas com essa rebelião deplorável.', '', '', '', '', '', 'Encontre a Patrulheira Sombria Lenara perto de Orgrimmar.', 32750),
(57150, 'ptBR', 'Milícia', 'Convoque os cidadãos de Orgrimmar.', 'A guerra é dispendiosa e nossas forças estão sendo dizimadas. Mas a Horda é, acima de tudo, forte. Cada habitante de Orgrimmar vale dez fracotes da Aliança no campo de batalha.\n\nReúna os cidadãos e forme uma milícia! Faça com que se lembrem de seus irmãos e irmãs que sucumbiram!', '', '', '', '', '', '', 32750),
(57149, 'ptBR', 'Remoção de Propaganda', 'Queime a Propaganda Dissidente em Orgrimmar.', 'Ultimamente, dissidentes têm divulgado propaganda pela cidade e espalhando mentiras de toda sorte.\n\nNão é hora de alimentar delírios. Um exército de traidores e inimigos jurados se reúne à nossa porta! Esses ingratos querem nos fazer de alvo para os arqueiros da Aliança.\n\n<Nathanos rola os olhos.>\n\nDeem fim a este lixo. Isso só pode disseminar o pânico nas ruas. \n\nCaso encontre qualquer tipo de... oposição... sinta-se $Gautorizado:autorizada; a fazer uso de força.', '', '', '', '', '', '', 32750),
(57148, 'ptBR', 'Quebra-cercos', 'Instale secretamente Caixotes Suspeitos e mate guardas.', 'Os tolos que seguem Saurfang se viram destemidos o bastante para lançar um ataque direto. Não podemos permitir que essa praga invada nossos portões.\n\nNossos agentes estão neste exato instante causando um desmoronamento no desfiladeiro entre o Monte Navalha e Orgrimmar, com o objetivo de dividir as forças insidiosas de Saurfang.\n\nSeu objetivo é se infiltrar e sabotar as máquinas de cerco deles. Use este disfarce, mas tenha em mente que ele não bastará se alguém $gexaminá-lo:examiná-la; você de perto. Mate qualquer um que descobrir você.', '', '', '', '', '', '', 32750),
(57147, 'ptBR', 'Não é minha Chefe Guerreira', 'Escape com Eitrigg e encontre Saurfang no Monte Navalha.', 'O tempo é escasso. Sylvana provavelmente sabe o que eu pretendo e mandou você para cuidar de mim. Duvido que ela vá ficar contente com a sua decisão.\n\nTemos que chegar até as mantícoras e nos alçar aos céus.', '', '', '', '', '', '', 32750),
(57130, 'ptBR', 'Traidores entre nós', 'Cuide desse traidor.', 'Lealdade e obediência cega são coisas bem diferentes. Eu me cansei de seguir as ordens da Banshee!', '', '', '', '', '', '', 32750),
(57126, 'ptBR', '... E seguindo mares', 'Visite Derek Proudmore e Calia Menethil.', 'Meu irmão Derek morreu na Segunda Guerra, apenas para ser reanimado contra a própria vontade pela Rainha Banshee. Se não fosse pelo corajoso ato de desafio de Baine Casco Sangrento, Derek teria sido transformado numa arma contra a minha família.\n\nMeu irmão vive em tormento desde o despertar. Temo que ele teria se perdido de nós, mas recebeu ajuda de uma velha amiga minha que também foi reanimada recentemente — Calia Menethil. Ela o trouxe de volta antes que caísse no precipício do desespero.\n\nEstou a caminho de uma visita a eles, você gostaria de vir junto?', '', '', '', '', '', '', 32750),
(57095, 'ptBR', 'Velho soldado', 'Honre o Lorde Supremo Saurfang.', 'Não importa o que algumas pessoas dizem, ele era um orc honorável. Uma verdadeira lenda, o ideal ao qual todos os guerreiros da Horda aspiravam. \n\nEle deu a vida para curar a ferida que dividia a Horda e nos deu a chance de forjar um novo caminho para o futuro. A morte não foi apenas digna de um guerreiro. Foi a morte de um herói.\n\nVamos honrar o sacrifício dele.', '', '', '', '', '', '', 32750),
(57094, 'ptBR', 'O preço da vitória', 'Informe Baine Casco Sangrento do que aconteceu.', 'Saurfang... eu...\n\n<Lor\'themar aproveita um momento para se recompor.>\n\nThrall quer honrar o sacrifício de Saurfang, assim como todos nós.\n\nReconvoque nossas forças, conte a eles o que aconteceu. Conte que o grande guerreiro Varok Saurfang está morto e que a Chefe Guerreira nos abandonou.\n\nFale com Baine quando chegar no Penhasco do Trovão, ele está no Platô dos Anciãos. Sei que ele também vai querer prestar respeitos a Saurfang. \n\nSejamos uma Horda unida mais uma vez.', '', '', '', '', '', 'Fale novamente com Lor\'themar diante dos portões de Orgrimmar.', 32750),
(57093, 'ptBR', 'Diante dos Portões de Orgrimmar', 'Inicie a batalha nos portões de Orgrimmar.', 'Chegou a hora.\n\nFizemos todos os preparativos possíveis. Só nos resta a própria batalha.\n\nNão sou muito de discursos. Então direi apenas isso:\n\nLok-tar ogar, $n. Vitória. Ou morte.', '', '', '', '', '', '', 32750),
(57092, 'ptBR', 'Posicionamento estratégico', 'Entregue as ordens de posicionamento de Saurfang.', 'Por anos eu guardei os portões de Orgrimmar. A maior fraqueza da cidade sempre foram as múltiplas entradas. Temos que atacar todas elas para conquistar a vitória.\n\nWrynn e eu elaboramos ordens de posicionamento. Os magos cobrirão nossos flancos. Greymane virá pelo oeste, e os elfos cuidarão do norte. Mandaremos Mayla para reforçar as defesas do Penhasco do Trovão para o caso de Sylvana lançar um contra-ataque.\n\nEntregue as ordens aos comandantes.', '', '', '', '', '', '', 32750),
(57091, 'ptBR', 'Já entre nós', 'Mate 10 Técnicos Suspeitos ou Assassinos Legalistas.', 'Sylvana ainda conta com a lealdade de boa parte da Horda. A guerra que ela começou os cegou com raiva e ódio. Ela se aproveita disso para manter apoio.\n\n<Saurfang faz uma careta.>\n\nEles ainda não entendem que ela nos levará à ruína, que as supostas vitórias dela são vazias.\n\nAlguns dos agentes dela foram avistados se esgueirando em nossas fileiras. Mate-os. Eles não nos mostrarão misericórdia, e não a receberão de nossas mãos.', '', '', '', '', '', '', 32750),
(57090, 'ptBR', 'Salvamento do cerco', 'Remova $1oa Caixotes Suspeitos.', 'Os espiões da Banshee conseguiram passar pelos nossos guardas na confusão dos desmoronamentos. Estão colocando bombas nas nossas armas de cerco.\n\nLivre-se das bombas.', '', '', '', '', '', '', 32750),
(57088, 'ptBR', 'Não é meu, não', 'Limpe a passagem entre o Monte Navalha e Orgrimmar de pedregulhos, minas e outras obstruções.', 'Os legalistas de Sylvana desmoronaram parte da trilha pelo cânion até Orgrimmar. Nossas forças agora estão isoladas.\n\nTemos que reforçar a linha de frente ou a Banshee nos eliminará, um por um. Chegamos longe demais para morrermos a morte dos mil cortes.\n\nGasganete e um dos gnomos da Aliança acham que têm a resposta. Melhor você garantir que o plano deles não exploda na nossa cara.', '', '', '', '', '', '', 32750),
(57002, 'ptBR', 'Velho soldado', 'Fale com Jaina diante dos Portões de Orgrimmar.', 'Independentemente das dúvidas que ele nutriu, Saurfang era um soldado honrado.\n\nEle evitou tanto uma guerra civil dentro da Horda quanto a potencial destruição da Aliança. Encerrou o reinado de Sylvana e salvou muitas vidas ao custo da própria. \n\nVamos honrar o sacrifício dele.', '', '', '', '', '', '', 32750),
(56993, 'ptBR', 'O preço da vitória', 'Reconvoque as forças da Aliança e informe o que aconteceu.', 'Saurfang... Como isso pôde acontecer...\n\n<Jaina aproveita um momento para se recompor.>\n\nA Aliança já conheceu o Lorde Supremo Saurfang tanto como inimigo figadal quanto como aliado indispensável.\n\nAnduin vai querer honrar a memória dele. Reconvoque nossas forças e informe o que aconteceu. As tropas de Genn foram despachadas ao portão oeste. Ele deve estar por lá.', '', '', '', '', '', 'Fale novamente com Jaina diante dos portões de Orgrimmar.', 32750),
(56982, 'ptBR', 'Diante dos Portões de Orgrimmar', 'Inicie a batalha nos portões de Orgrimmar.', 'Nós nos preparamos o tanto que é possível para essa batalha, $p.\n\nRezo pela nossa sobrevivência ao que está por vir.', '', '', '', '', '', '', 32750),
(56981, 'ptBR', 'Posicionamento estratégico', 'Entregue as ordens de posicionamento de Anduin.', 'Segundo Saurfang, a chave da tomada de Orgrimmar é se aproveitar dos múltiplos pontos de entrada. Ele liderou as defesas da cidade por anos e conhece as vulnerabilidades melhor que ninguém. Já estamos espalhados demais, só que eu confio no julgamento dele nessa questão.\n\nTambém temos que fortificar o Penhasco do Trovão para o caso de Sylvana planejar um ataque enquanto nossas forças estiverem ocupadas aqui.\n\nEntregue estas ordens de posicionamento aos nossos oficiais. Vamos assaltar todos os portões de Orgrimmar enquanto também defendemos o Penhasco do Trovão.', '', '', '', '', '', '', 32750),
(56980, 'ptBR', 'Já entre nós', 'Mate 10 Técnicos Suspeitos ou Assassinos Legalistas.', 'Ainda que parte da Horda tenha juntado forças conosco, muitos em Orgrimmar continuam fiéis a Sylvana. Os sabotadores dela se infiltraram em nossas fileiras e se disfarçam de técnicos. Seus assassinos espreitam nas sombras.\n\nDetenha qualquer legalista que você encontrar, antes que possam fazer o mal.', '', '', '', '', '', '', 32750),
(56979, 'ptBR', 'Salvamento do cerco', 'Remova $1oa Caixotes Suspeitos.', 'No caos dos desmoronamentos, Sylvana enviou sabotadores para se esgueirar por nossas sentinelas e plantar explosivos nas nossas armas de cerco. \n\nJá perdemos várias delas, e não podemos perder mais.', '', '', '', '', '', '', 32750),
(56842, 'ptBR', 'Preservação lunar', 'Execute o Rito da Lua nos poços lunares espalhados pelo mundo. Você pode encontrá-los no Vale Gris, Selva Maleva, Feralas, Clareira da Lua, Cordilheira das Torres de Pedra, Floresta do Crepúsculo e Monte Hyjal.\n\nSe você deixar a Bênção da Lua expirar, terá que começar de novo.', 'Meu cajado me serviu bem por muitos anos. Ficou ao meu lado, passou por muitas provações... e, conforme eu envelheço, percebo que me apoio nele cada vez mais.\n\nAs flores dele brotam a cada Festival da Lua, banhando-se no poder de Eluna. Elas me trazem tanta alegria que eu deixo que floresçam o ano todo. Sei de um jeito... mas meus ossos estão velhos demais para empreender a jornada.\n\nVocê viajaria por mim? Energize meu cajado à luz da lua nos poços lunares pelo mundo. Então minhas flores permanecerão.', '', '', '', '', '', 'Fale novamente com Myrael Lunaflor na Clareira da Lua.', 32750),
(56833, 'ptBR', 'Líderes da Horda', 'Ordene que os líderes da Horda em Orgrimmar se preparem para a batalha.', 'Saurfang mostrou as garras e agora conta com o apoio da Aliança. \n\nFale com os que continuam leais à Horda. Eles devem se preparar para lutar contra nossos inimigos.\n\nE, quanto a Eitrigg... entregue-o a Nathanos. Uma morte rápida é um castigo suave demais para a traição dele.\n\nVá, $n. Vamos acabar com isso.', '', '', '', '', '', '', 32750),
(56746, 'ptBR', 'Nossa linha direta', 'Crie $1oa itens de Sucatrônica com o Pascal-R31.', 'Certamente você concorda que o Pascal-R31 é a maior invenção que você já viu!\n\nSó que, se você ainda não se convenceu, tente forçar os limites dele. Eu não ligo!\n\nTraga mais recursos e projetos, e ele montará qualquer coisa que você quiser!', '', '', '', '', '', '', 32750),
(56719, 'ptBR', 'Não é meu, não', 'Limpe a passagem entre o Monte Navalha e Orgrimmar de pedregulhos, minas e outras obstruções.', 'Você chegou em boa hora, $n. Os seguidores de Sylvana derrubaram parte do cânion que leva a Orgrimmar.\n\nEstamos isolados da nossa vanguarda e temo que eles serão destruídos se não receberem reforços rapidamente. Nossas forças são pequenas. Não podemos arcar com o preço se eles ficarem acossados por muito tempo.\n\nO Mestre-faz-tudo Superchispa e Gasganete acreditam ter uma solução. Corra para ajudá-los no que for possível.', '', '', '', '', '', '', 32750),
(56623, 'ptBR', 'Dominância de Ashran', 'Derrote a Horda em todos os locais de evento em Ashran e mate o Sumo Senhor da Guerra Volrath.', 'Nós temíamos que a Horda tentasse fortalecer sua posição aqui na ilha por meio de saques, e eles estão fazendo justamente isso. Vá mostrar a eles que a Aliança não vai tolerar essa agressão.', '', 'Volrath lidera as forças da Horda em Ashran.', '', '', '', '', 32750),
(56504, 'ptBR', 'Diário de Wrathion', 'Entregue o diário incompleto de Wrathion à M.A.D.R.E.', 'As vozes se calaram assim que bebi da poção. Eu agradeço, $p.\n\nAinda assim, N\'Zoth ter conseguido me atingir mesmo dentro da Câmara do Coração é uma coisa gravíssima. Caso Wrathion tenha descoberto uma forma de resistir ao poder dos Deuses Antigos, nós poderemos usá-la para reforçar as defesas da Câmara.\n\nTalvez a M.A.D.R.E. consiga extrair mais informações do diário de Wrathion.', '', '', '', '', '', '', 32750),
(56496, 'ptBR', 'À véspera da batalha', 'Fale com Lor\'themar.', '$n, temos que conversar sobre a Horda... e a Chefe Guerreira.\n\nA guerra já nos custou muito caro, e a batalha contra Azshara esgotou os poucos recursos que nos restavam. A Horda está dividida de novo, e a Aliança não se encontra muito melhor. \n\nSylvana tem a oportunidade de destruir todos que ela considera como inimigos, o que também nos inclui.\n\nEu tinha esperanças de que minha velha amiga ouviria a voz da razão, mas, agora...\n\nO Lorde Supremo Saurfang está reunindo todos de nós que ainda restam — incluindo alguns aliados improváveis.', '', '', '', '', '', 'Fale com Varok Saurfang no Monte Navalha.', 32750),
(56495, 'ptBR', 'Eles avançam contra nós', 'Encontre-se com Sylvana em Orgrimmar.', 'A Dama Sombria solicita sua presença em Orgrimmar, $n. \n\nPelo visto, os ratos finalmente saíram da toca. Vai ser muito mais fácil dar fim a eles.\n\nNão se atrase. Já esperamos tempo demais por este momento.', '', '', '', '', '', '', 32750),
(56494, 'ptBR', 'À véspera da batalha', 'Fale com Mathias Shaw.', '$n. A hora é chegada.\n\nDerrotamos Azshara, mas ainda temos que lidar com Sylvana. Mesmo que nossa posição não seja ideal, nós mobilizamos todas as nossas forças disponíveis e estamos prontos para encerrar esta guerra.\n\nO Rei Wrynn me pediu para atualizar você quanto à situação antes de nos juntarmos a ele. Houve alguns... eventos interessantes.', '', '', '', '', '', 'Fale com Anduin Wrynn no Monte Navalha.', 32750),
(56475, 'ptBR', 'Chifre de Yeti Espiralado', 'Leve o Chifre de Yeti Espiralado para a Matriarca-da-colmeia Meleira e receba a recompensa.', 'Muitas e muitas criaturas são atraídas pelo doce perfume de mel fresco, só que relativamente poucas estão dispostas a aguentar as ferroadas dolorosas e até mortíferas das abelhas maiores. Este yeti, porém, vinha sendo uma pedra no sapato da colmeia até agora.\n\nA Matriarca-da-colmeia ficará interessada nesse item.', '', '', '', '', '', 'Leve o Chifre de Yeti Espiralado para a Matriarca-da-colmeia Meleira e receba a recompensa.', 32750),
(56474, 'ptBR', 'Ferrão de Arrasa-colmeias', 'Leve o Ferrão de Arrasa-colmeias para a Matriarca-da-colmeia Meleira e receba a recompensa.', 'As vespas são o inimigo natural das abelhas, e essa assassina altamente especializada é a mais letal de todas. Felizmente, graças a você, ela não vai mais aterrorizar a colmeia.\n\nA Matriarca-da-colmeia ficará interessada nesse item.', '', '', '', '', '', 'Leve o Ferrão de Arrasa-colmeias para a Matriarca-da-colmeia Meleira e receba a recompensa.', 32750),
(56473, 'ptBR', 'Presa de Aranha Envenenada', 'Leve a Presa de Aranha Envenenada para a Matriarca-da-colmeia Meleira e receba a recompensa.', 'Até as abelhas mais cautelosas caíram vítimas dessas enormes aranhas. Elas ficam de tocaia perto dos canteiros de flores e emboscam as abelhas que coletam o pólen. Graças a você, elas terão uma aranha a menos com que se preocupar.\n\nA Matriarca-da-colmeia ficará interessada nesse item.', '', '', '', '', '', 'Leve a Presa de Aranha Envenenada para a Matriarca-da-colmeia Meleira e receba a recompensa.', 32750),
