(56267, 'ptBR', 'Sussurros de N\'Zoth', 'Fale com Kalecgos na Câmara do Coração.', 'Temos uma emergência, $gcampeão:campeã;! Precisamos de ti na Câmara do Coração pra já;\n\nTem alguma coisa do djanho entrando na cabeça do Chifre de Ébano. Ele não consegue se livrar!\n\nTalvez tu possa ajudar!', '', '', '', '', '', 'Fale com Kalecgos na Câmara do Coração.', 32750),
(56266, 'ptBR', 'Mugglrgl do Mgglurquinho', 'Recupere o Mugglrgl do Mgglurquinho na Aldeia Pinassangre.', 'Mgglurquinho, meu cozinheiro, perdeu o mugglrgl dele e se recusa a trabalhar enquanto não achar.\n\nEu estou com o bar lotado de murlocs famintos e não tenho nada para oferecer enquanto o Mgglurquinho não começar a cozinhar. Se o Mgglurquinho não achar o mugglrgl dele logo, isso aqui vai virar um tumulto!\n\nNão sei você, mas eu não quero virar o prato principal da noite.\n\nMais cedo, alguns Pinassangre estavam xeretando por aí. Procure o mugglrgl na Aldeia Pinassangre e traga de volta assim que achar.', '', '', '', '', '', '', 32750),
(56203, 'ptBR', 'Blueprint: TK44[DNT]', 'Transmita o projeto para o banco de dados do Pascal-R31.', '<This blueprint details how to build what appears to be TK.[DNT]\n\nYou should be able to upload the blueprint to Pascal-K1N6\'s database in Rustbolt.>', '', '', '', '', '', 'Transmita o projeto para o banco de dados do Pascal-R31 em Ferrúgia.', 32750),
