(56190, 'ptBR', 'Salve Chifre de Ébano', 'Volte à Câmara do Coração e trate Chifre de Ébano com a Poção da Clareza Mental.', '<Parece ser uma poção bem poderosa e caótica. Ela muda de cor o tempo todo.\n\nDeve ser o preparado que Wrathion mencionava no diário. Só de ficar perto, você já experimenta uma sensação de paz e clareza.\n\nAinda que não tenha encontrado o Príncipe Negro, pode ser que a poção que ele deixou para trás venha a ajudar Chifre de Ébano.>', '', '', '', '', '', '', 32750),
(56189, 'ptBR', 'No rastro do Príncipe Negro', 'Entre nas Catacumbas de Karazhan e busque uma cura para Chifre de Ébano.', '<Parece que houve uma luta aqui. Os agentes de N\'Zoth já devem ter entrado nas catacumbas sob Karazhan.\n\nO vigia morto ainda conserva um molho de chaves. Pode ser que alguma destranque a porta.\n\nSe tudo certo, pode ser que você encontre Wrathion antes dos agentes de N\'Zoth e ainda consiga algo valioso para o Chifre de Ébano.>', '', '', '', '', '', '', 32750),
(56188, 'ptBR', 'Às catacumbas!', 'Procure Wrathion diante das Catacumbas de Karazhan.', 'Eu resisti o máximo que pude, mas... as vozes eram fortes demais.\n\nVocê tem que correr para Karazhan. O Príncipe Negro disse que queria estudar os artefatos das catacumbas.\n\nPor favor, não permita que meu fracasso venha causar a ruína dele!', '', '', '', '', '', 'Procure Wrathion diante das Catacumbas de Karazhan.', 32750),
(56187, 'ptBR', 'Sombra de Asas Pretas', 'Procure Wrathion em frente à entrada do Descenso do Asa Negra.', 'Está na cara que o Príncipe Negro não está aqui. Vá por mim, ele não é sujeito fácil de se encontrar.\n\nSe eu fosse você, seguia para a Montanha Rocha Negra. Tem um terraço nas saliências naturais que Nefarian fazia de covil antigamente.\n\nWrathion vem monitorando o lugar faz tempo. Mesmo que ele em si não esteja lá, deve ter alguém que saiba onde procurá-lo.\n\nE, $c... já ficou claro que você não é $Go único:a única; atrás dele. Se cuide.', '', '', '', '', '', '', 32750),
(56186, 'ptBR', 'Espiões por todos os lados', 'Procure Wrathion na Taberna nas Nuvens.', 'Chifre de Ébano não vai resistir às vozes por muito tempo. As forças sombrias que um dia corromperam a revoada dragônica negra buscam dominar o mundo outra vez.\n\nPrecisamos revidar. Não gosto nem de falar o nome do sujeito, mas conheço uma pessoa que vem estudando os Deuses Antigos a fim de combater seu poder nefasto: Wrathion.\n\nO Príncipe Negro será difícil de encontrar. Sei que ele tem associados em Pandária, na Taberna nas Nuvens, que fica na Escadaria Oculta. Sugiro começar a busca por lá.\n\nPor favor, encontre-o quanto antes, $p.', '', '', '', '', '', '', 32750),
(56185, 'ptBR', 'Sussurros de N\'Zoth', 'Fale com Kalecgos na Câmara do Coração.', 'Temos uma emergência, $gcampeão:campeã;! Precisamos de ti na Câmara do Coração pra já;\n\nTem alguma coisa do djanho entrando na cabeça do Chifre de Ébano. Ele não consegue se livrar!\n\nTalvez tu possa ajudar!', '', '', '', '', '', 'Fale com Kalecgos na Câmara do Coração.', 32750),
(56144, 'ptBR', 'Pata da Velha Nasha', 'Leve a Pata da Velha Nasha para a Matriarca-da-colmeia Meleira e receba a recompensa.', 'A pata da velha ursa está grudenta com mel. Ela provavelmente saqueou várias colmeias antes de você detê-la.\n\nA Matriarca-da-colmeia ficará interessada nesse item.', '', '', '', '', '', 'Leve a Pata da Velha Nasha para a Matriarca-da-colmeia Meleira e receba a recompensa.', 32750),
(56108, 'ptBR', 'Abandonando a colmeia', 'Fale com Abelardo na Incubadora Meleira.', '<A imensa abelha mexe as antenas na sua direção e abana o abdome para a saída da caverna.>\n\nTalvez Abelardo saiba o que está acontecendo.', '', '', '', '', '', '', 32750),
(56097, 'ptBR', 'Disco encardido', '', '<Procure alguém capaz de recuperar os dados presos no disco tão sujo.>', '', '', '', '', '', 'Entregue o Disco Encardido a Bibi Rangetranca.', 32750),
(56092, 'ptBR', 'Estoque de Geleia do Furtamel', 'Leve o Estoque de Geleia do Furtamel para a Matriarca-da-colmeia Meleira e receba a recompensa.', 'Este gorjala era um sujeito bem conhecido e muito temido pelas abelhas da colmeia Meleira. As reservas de geleia delas se beneficiarão com a morte dele.\n\nA Matriarca-da-colmeia ficará interessada nesse item.', '', '', '', '', '', 'Leve o Estoque de Geleia do Furtamel para a Matriarca-da-colmeia Meleira e receba a recompensa.', 32750),
(56091, 'ptBR', 'Glândula Odorífera da Usurpadora', 'Leve a Glândula Odorífera da Usurpadora até a Matriarca-da-colmeia Meleira para receber a recompensa.', 'Quando uma nova rainha nasce e tem idade suficiente para começar a proliferar o próprio enxame, ela deixa o ninho. O perfume dela atrai parte do enxame com ela para o novo lar. Esta aqui nunca teve a chance de fazê-lo, graças a você.\n\nA Matriarca-da-colmeia ficará interessada nesse item.', '', '', '', '', '', 'Leve a Glândula Odorífera da Usurpadora até a Matriarca-da-colmeia Meleira para receber a recompensa.', 32750),
(56081, 'ptBR', 'Agarrão óctuplo', '', '', '', '', '', '', '', '', 32750),
(56072, 'ptBR', 'Vibrolâmina Dessincronizada', 'Leve a Vibrolâmina Dessincronizada para Safroneta Flaivvers em Ferrúgia.', 'A lâmina trêmula lembra as armas usadas pelos defensores de Ferrúgia. Sem sombra de dúvida, alguém vai saber como consertá-la.', '', '', '', '', '', '', 32750),
