(55527, 'ptBR', 'Veja se consegue...', 'Obtenha para Mrrl 3 Comidas Fantasmas, 3 Almoços Saudáveis de Murloc e 3 Poeiras dos Pés do Gigante do Mar.', '<Mrrl aponta para a sua mochila e desenha algumas figuras na areia. Ele puxa um belo objeto de trás de uma rocha e aponta furiosamente para si e, depois, novamente para a sua mochila.\n\nVocê acha que ele quer fazer uma troca.>', '', '', '', '', '', '', 32750),
