(55346, 'ptBR', 'O pupilo da patrulheira sombria', 'Encontre a Patrulheira Sombria Velonara nas Clareiras de Tirisfal.', 'Sou Murgoth, caçador de inimigos temíveis e herói da Tenda Tirocerto.\n\nVocê é $Gum renomado campeão:uma renomada campeã; da Aliança, mas me contaram que você salva quem está em perigo. Por favor escute.\n\nSou amigo de uma patrulheira chamada Velonara. Ela serve à Horda, mas lhe garanto que é uma alma nobre.\n\nEla vem treinando um patrulheiro aprendiz que desapareceu depois de receber uma carta do próprio irmão. Velonara foi às Clareiras de Tirisfal procurá-lo.\n\nEstou com um mau pressentimento sobre isso. Você pode verificar se ela está bem?', '', '', '', '', '', 'Encontre a Patrulheira Sombria Velonara.', 32750),
