(55111, 'ptBR', 'Estudo de Criatura: Naga Zanj\'ir', 'Use o Pergaminho de Maedin para coletar dados de várias criaturas de Nazjatar.', '<O pergaminho mágico está coberto de garranchos — as anotações incompletas de Maedin sobre as nagas Zanj\'ir.>', '', '', '', '', '', 'Leve o pergaminho completo para Maedin.', 32750),
(55084, 'ptBR', 'Projeto: rádio do mercado negro criptografado', 'Transmita o projeto para o banco de dados do Pascal-R31.', '<Este projeto detalha como construir o que parece ser um transmissor de rádio altamente criptografado.\n\nDeve ser possível transmitir o projeto para o banco de dados do Pascal-R31 em Ferrúgia.>', '', '', '', '', '', 'Transmita o projeto para o banco de dados do Pascal-R31 em Ferrúgia.', 32750),
(54941, 'ptBR', 'Missão de reconhecimento na praia', 'Localize os batedores ankoanos na Praia Gris.', 'Faz tempo que não recebemos notícias dos nossos batedores no posto avançado.\n\nVai ver o ataque das nagas cortou a comunicação. Eu preciso me atualizar acerca das manobras do exército das nagas com eles.\n\nVocê devia vir comigo, vai ser uma boa oportunidade de conhecer o clã melhor e observar a operação mais de perto.', '', '', '', '', '', '', 32750),
