(54052, 'ptBR', 'Questfall', 'Slay $2oa Riverpaw Gnolls and defeat Barkpaw.', 'Me apologies, matey! New to the bow! More of a sword arm, yeah?!\n\nDidn\'t mean ta give ya such a start! It\'s just that we\'re in a bit of a bind, me an\' the crew here!\n\nCan ya give us a bit of a hand?! Some upright dogs attacked us in the dead of night! Chased us out of camp in our skivvies!\n\nMaybe ya can help?! They had some sort of big one as their boss! We\'ve been callin\' him Barkpaw on account of he was barkin\' at us and had big ol\' paws!', '', '', '', '', '', '', 32750),
(54017, 'ptBR', 'Trabalho Sujo: Kraal de Feras de Guerra', '', '', '', '', '', '', '', '', 32750),
(54011, 'ptBR', 'Serviço sujo: Brado de Arom', '', '', '', '', '', '', '', '', 32750),
(53983, 'ptBR', 'Serviço sujo: Forte Cavaleiro', '', '', '', '', '', '', '', '', 32750),
(53977, 'ptBR', 'O Baú de Guerra', 'Colete recursos do Baú de Guerra em Bashal\'Aran.', 'Bem-$Uvindo:vinda; ao front de guerra, $n! Finalmente vamos entrar em ação.\n\nAgora é hora de pôr aquilo tudo que coletamos para trabalhar para nós! Qualquer recurso que coletamos vai para o Baú de Guerra. Quando o suficiente for coletado, você poderá usá-lo.\n\nPor que você não dá uma olhada lá e vê o que consegue?', '', '', '', '', '', '', 32750),
(53975, 'ptBR', 'Voo noturno', 'Entregue o Bilhete de Sombracerta ao comando em Bashal\'Aran.', 'Agora que controlamos o Depósito Freixal nossa movimentação pelo campo de batalha será muito mais conveniente.\n\nTracei o esboço de uma rede de voo. É um plano brilhante, se me permito dizer. Você não parece ocupad$go:a;. Pegue as minhas anotações e leve ao comando imediatamente.\n\nFale com o Fidélio. Ele vai providenciar um hipogrifo.', '', '', '', '', '', 'Entregue o Bilhete de Sombracerta ao comando em Bashal\'Aran.', 32750),
(53974, 'ptBR', 'Druidas do Martriste', 'Capture a Faixa do Martriste e fale com Edgard para saber o que ele pode oferecer.', 'O poder latente na Faixa do Martriste representa uma chance de obtermos uma grande vantagem. Um dos nossos aliados, Edgard, tem vasto conhecimento do que isso pode significar para nossos esforços.\n\nProcure-o e descubra o poder da natureza.', '', '', '', '', '', '', 32750),
(53961, 'ptBR', 'Minha forja de glaives', 'Fale com Erion para saber o que a Forja de Glaives pode oferecer.', 'Estamos todos mal desde Teldrassil, mas o Erion está pior. Ele agarrou a primeira oportunidade de ajudar.\n\nPor que não fala com o Erion e vê o que ele anda fazendo na Forja de Glaives?', '', '', '', '', '', '', 32750),
(53960, 'ptBR', 'O Altar dos Anciões', 'Fale com a Sacerdotisa da Lua Lasara para aprender o que o Altar dos Anciões tem a oferecer.', 'Agora que as contribuições estão de vento em popa, o Altar dos Anciões foi reconstruído.\n\nFale com a Sacerdotisa da Lua Lasara para aprender o que o Altar tem a oferecer.', '', '', '', '', '', '', 32750),
(53959, 'ptBR', 'Armadura para exércitos', 'Fale com Cordressa Cravoarco para saber o que o Salão dos Caçadores tem a oferecer.', 'Precisamos garantir que nossos soldados tenham o melhor equipamento possível na batalha contra a Horda.\n\nQuando o Salão dos Caçadores estiver de pé, fale com Cordressa Cravoarco sobre como aprimorar as armas e armaduras da nossa tropa.', '', '', '', '', '', '', 32750),
(53957, 'ptBR', 'Recrutas da Costa Negra', 'Restaure o Anciente da Guerra e fale com Jared Cantonegro para recrutar um aliado.', 'Conseguimos recrutas que podem ajudar a retomar a Costa Negra!\n\nMas antes precisamos que o nosso Anciente da Guerra esteja em boas condições. Para isso, contribua com recursos, que ele fica de pé de novo rapidinho!\n\nQuando o Anciente da Guerra estiver recuperado, fale com Jared Cantonegro e recrute alguém para a tropa. Tenho certeza de que todos podem aprender muito lutando ao seu lado.', '', '', '', '', '', '', 32750),
