(50743, 'ptBR', 'O problema imediato', 'Fale com a Tenente Hauer.', 'Enviei uma tenente, uma mulher chamada Hauer, ao vilarejo dos pescadores logo mais à frente pela estrada. Recebemos alguns relatos de atividade naga se espalhando pela costa naquela direção.\n\nPrecisamos trazer as forças de volta o quanto antes. Quero que você se junte a ela e dê auxílio aos moradores do vilarejo.', '', '', '', '', '', '', 32750),
(50690, 'ptBR', 'UNUSED', 'Fale com Moxie Lanceta.', 'Em algum lugar, enterrado naquela lama, tem um barco da Horda que afundou na Segunda Guerra. Ele estava repleto de ouro saqueado, que nós vamos encontrar!\n\nFala com a Moxie. Ela que cuida das burocracias da busca do tesouro. Ela te bota pra trabalhar.', '', '', '', '', '', '', 32750),
