(50384, 'ptBR', 'Doug Test - Completable Quest4', 'Fale com Barão Zibecrina no Círculo Sangrento, que fica nas Montanhas da Lâmina Afiada.', '$n, enquanto você estava ausente sendo $gum:uma; $c de verdade, o Barão Zibecrina enviou seu dragão de estimação com uma mensagem.$B$BEle perguntou por você diretamente. Pelo que entendi, ele quer que você lidere a luta contra os gronns.$B$BAcho que você é a pessoa mais qualificada de toda Terralém para a tarefa. Mesmo assim, acho que seria prudente convocar alguns amigos. Peça que $go:a; encontrem no Círculo Sangrento.', '', '', '', '', '', '', 32750),
(50350, 'ptBR', 'Precisamos de um químico', 'Encontre o Químico-chefe Walters.', 'Todo esse caos começou quando a gente estava cutucando um grande veio de azerita no fundo da mina. Aí a mina começou a tremer, e essas criaturas todas brotaram do chão. Se a gente se livrasse daquele veio, com certeza retomaria a mina.\n\nPrimeiro, a gente precisa de um químico. O nosso melhor químico está no laboratório dele, do outro lado do rio. Encontre-o, e ele lhe dará mais instruções.', '', '', '', '', '', '', 32750),
(50195, 'ptBR', 'Brigada de Malhoquilha', 'Derrote o Capitão Malhoquilha na Costa Salobra e saqueie os Espólios de Guerra dele.', '<De acordo com essas ordens, um tal Capitão Lobo do Mar anda contratando esses assassinos. Ele se encontra numa cabeça de praia em Drustvar.\n\nAcabar com ele seria um golpe duro contra os esforços de guerra da Horda. E isso poderia pôr um fim nessas emboscadas.>', '', 'Capitão do Salão do Salgado e líder da incursão na Costa Salobra.', 'Capitão Malhoquilha', '', '', '', 32750),
(49931, 'ptBR', 'A ira do Titã', '', '', '', '', '', '', '', '', 32750),
(49789, 'ptBR', 'O juramento', 'Volte a Ventobravo e fale com Anduin.', 'Os etéreos estavam apenas aguardando que alguém forte o bastante no caos fosse corrompido pelo poder dos Deuses Antigos.\n\nChegamos a tempo de salvá-los, e vou lhes ensinar como resistir às vozes.\n\nUmbric está pronto para se juntar à Aliança. Vamos voltar para Ventobravo e informar o Rei Wrynn.', '', '', '', '', '', '', 32750),
(49769, 'ptBR', 'Destroços do Cataclismo', 'Encontre Rokor na Praia do Catador.', 'Em anos recentes, um dos maiores templos de loa dos Zandalari desabou misteriosamente no mar. Ninguém sabe muito bem qual foi a causa nem quais tesouros se perderam na catástrofe.$b$bMeu primo Rokor era o encarregado da salvatagem. No templo há muitos itens com conhecimentos e poderes incríveis. Aposto que ele tem interesse nos serviços de alguém forte e com fôlego como você.', '', '', '', '', '', 'Encontre Rokor na Praia do Catador.', 32750),
(49661, 'ptBR', 'Ovos de produção local', 'Colete $1oa Ovos de Espirescama nos Ninhos de Espirescama.', 'Nada no mundo se compara à comida preparada com os melhores e mais frescos ingredientes!$b$b$GMeu caro:Minha cara;, estou numa busca. Na busca pelos ovos perfeitos! Fiquei sabendo dos ovos de enguia: textura delicada, uma leve toque de sal marinho... um perfil único de sabor! Preciso deles!$b$bAs enguias depositam os ovos na terra e voltam para o mar. Por favor, colete esses ovos para que eu possa criar a mais elegante das omeletes!', '', '', '', '', '', '', 32750),
(49464, 'ptBR', 'Rabos de saurolisco', 'Colete $1oa Rabos de Saurolisco dos Sauroliscos Boca-de-lodo.', 'No alto escalão da sociedade kultirena, há uma culinária que desafia até mesmo os chefs mais obstinados. Nobres pagam fortunas exorbitantes para experimentar essa iguaria, temperada e preparada para deleite do freguês.$b$bFalo, é claro, da rabada de saurolisco.$b$bPreciso descobrir qual é o melhor método de preparo para esse ingrediente cobiçado! Na panela? Recheado? Escaldado? Quem sabe no vapor ou branqueado fique melhor!$b$bClaro, precisarei de uns rabos para fazer os testes.', '', '', '', '', '', '', 32750),
