(48905, 'ptBR', 'Pergaminhos desprezados', 'Recupere $1oa Pergaminhos Tortollanos.', 'Já que você está aqui em Natha\'vor, pode muito bem ajudar o restante dos peregrinos com um problema.\n\nUns trolls roubaram vários dos nossos pergaminhos. Por que, eu não faço ideia, duvido que eles saibam ler.\n\nQuero que você recupere os pergaminhos. Não sou mais jovem, não posso ficar lançando magias de memória!\n\nEspecialmente magia curativa... coisa que o Shoak certamente vai precisar quando você resgatar a casca burra dele.', '', '', '', '', '', '', 32750),
(48808, 'ptBR', 'Defesa de tese', 'Recupere as Páginas da Tese.', 'Minha tese!\n\nAqueles troggs fedidos levaram minha tese e deram de comida aos javalis! Dá para acreditar!?\n\nEu passei uma eternidade trabalhando nela! Dois dias inteiros! Se eu não recuperar as páginas, vai ser o meu fim!\n\nPor favor, recupere minha tese para mim?', '', '', '', '', '', '', 32750),
(48489, 'ptBR', 'As torres de casa', 'Fale com Alleria Correventos na Ilha de Quel\'Danas.', 'Minha irmã Vereesa me contou dos acontecimentos que levaram os elfos superi... perdão, sangrentos a se juntarem à Horda.\n\nParte de mim ainda não aceita isso.\n\nO príncipe Kael\'thas levou meu povo por caminhos sombrios. Preciso acreditar que a maior parte dos sin\'dorei se livraria da Horda se tivesse escolha.\n\nDa última vez que falei com Lor\'themar, nós servíamos juntos com os Andarilhos. Ele era um ótimo patrulheiro e uma pessoa de bom coração. Rezo para que os anos não o tenham mudado.\n\nVamos. Não podemos deixar o regente esperando.', '', '', '', '', '', '', 32750),
(48104, 'ptBR', 'Um desafio maior', '', '<this is a placeholder breadcrumb for a NYI POI.>', '', '', '', '', '', '', 32750),
