(47695, 'ptBR', 'O som dos mares', 'Mate $1oa Sirenas Lamentosas na Praia do Penhasco Enevoado.', 'Sirena é problema! Elas levam nossos homens e nunca mais devolvem. Como é que a gente vai conseguir levar a mercadoria para Boralus com essas criaturas rondando?$b$bJá que você já está indo para aquelas bandas... que tal dar um jeito em algumas?', '', '', '', '', '', '', 32750),
