(47460, 'ptBR', 'Interact - Doodad & Creature Test [DO NOT LOCALIZE]', 'Interaja com $1oa Proteções e fale com o Protetor Malo.', 'Conclua essa missão para testar os objetivos de missão do tipo Interação — Treco e Interação — Criatura.', '', '', '', '', '', '', 32750),
(47002, 'ptBR', 'A Coroa do Triunvirato', 'Proteja Velen enquanto ele localiza os fragmentos da Coroa do Triunvirato.', 'Vamos começar as buscas, $n.$b$bA Coroa do Triunvirato foi criada para espalhar o toque da Luz por todo o mundo. Com ela, nossa cultura prosperou.$b$bQuando fugi de Argus com os draeneis, levei um fragmento da Coroa comigo para que não caísse em mãos erradas.$b$b<Velen inclina o cajado para frente e aponta para o cristal central.>$b$bOs fragmentos de Kil\'jaeden e Arquimonde ainda estão aqui. Vou buscá-los, mas tu terás que me proteger nessa jornada.$b$bNão te afastes, $Gmeu caro:minha cara;.', '', '', '', '', '', '', 32750),
(46026, 'ptBR', 'Um aviso urgente', 'Fale com o Senhor Celeste Omnuron', '<O soldado está pálido e ferido, sua dor é evidente.>\n\nFiquei preso... desde o ataque... à Costa Partida...\n\n<Ela estremece.>\n\nOs demônios... e-estão se reunindo... se preparando...\n\nTive que fugir... para avisá-$Glo:la;. Você tem que... detê-los!', '', '', '', '', '', '', 32750),
