(45803, 'ptBR', 'A ocupação de Antônidas', 'Recupere os três discos do projeto incompleto de Antônidas e leve-os a Kalec no seu Salão da Ordem. Converse com o Arquimago João Nicolau em Nortúndria, no Salão Púrpura, sobre o Disco Triplo do Arcano. Fale com Hadggar sobre o Disco Triplo do Fogo. E fale com o Arquimago Cedric perto da Cratera de Dalaran sobre o Disco Triplo do Gelo.', 'Arquimag$Go:a;, encontrei algo que talvez lhe interesse: um diário velho do finado arquimago Antônidas. Nele, o arquimago menciona um projeto em que estava trabalhando que, talvez, possamos terminar.$b$bEra um tipo de disco voador capaz de se harmonizar com a sintonia mágica do piloto.$b$bMas eu preciso da sua ajuda para encontrar as peças. Pelo que descobri, ele as deu a amigos e aliados de confiança no decorrer dos anos. Talvez você consiga persuadir essa gente a nos entregar as peças.', '', '', '', '', '', '', 32750),
