(41880, 'ptBR', 'Covil das Sombras', 'Faça contato com Arluin Umbralâmina.', 'Temporário: Thalyssra envia você para encontrar Arluin Umbralâmina, um assassino habilidoso que já esteve a serviço dela/fez parte do círculo social dela. (o que encaixar melhor) Indicar que ele seria alguém inestimável para se progredir na Cidade por meio de operações sigilosas.', '', '', '', '', '', '', 32750),
