(40906, 'ptBR', 'Serpentes das profundezas', 'Fale com Toryl do lado de fora de Jandvik.', 'Salve, $c.$B$BJandvik, a minha vila, está sendo atacada por um grupo de nagas, as Sashj\'tar.$B$BNormalmente, eu não buscaria a ajuda de $Gum forasteiro:uma forasteira;, mas estamos enfrentando um inimigo que não somos capazes de vencer.$B$BMuitas relíquias élficas poderosas podem ser encontradas nas ruínas ao redor de Jandvik. Em troca da sua ajuda, você receberá recompensas à altura.$B$BTemos um acordo?', '', '', '', '', '', '', 32750),
(40829, 'ptBR', 'PrGMasmorras - Draenor 6.2 - Localizador de Raides - 1ª', '', '', '', '', '', '', '', '', 32750),
(40659, 'ptBR', 'Olhos voltados para as estrelas', 'Colete 4 Estrelas do Mar dos Trincheiradores Anciões na Baía Brisazúli.', 'Você acha que essas nagas são complicadas, $Gcoelhinho:coelhinha;?$B$B<Stokalfr ri.>$B$BEu aproveitaria a oportunidade para lutar com um daqueles monstros incrustados de cracas.$B$BSe você quiser me impressionar, traga aqui as estrelas de suas cabeças. Talvez eu considere você como $Gum:uma; $c de verdade.', '', '', '', '', '', '', 32750),
(40635, 'ptBR', 'Assassino de Sashj\'tar', 'Mate 12 Nagas Sashj\'tar na Enseada Brisazúli.', 'Não consigo acreditar que Throndyr se foi.$B$BPelos chifres em minha cabeça, nos vingaremos de toda a dor que as Sashj\'tar nos causaram!$B$BAvante, $n. Mate-as todas! Mate-as todas!', '', '', '', '', '', '', 32750),
(40342, 'ptBR', 'Surpresa para as Sashj\'tar', 'Mate 12 Campeões Sashj\'tar ou Bruxas das Profundezas Sashj\'tar na Baía Brisazúli.', 'As nagas estão preocupadas com o recrutamento dos gigantes do mar para as batalhas da Rainha Azshara em outras terras.$B$BAgora é a hora de atacar!', '', '', '', '', '', '', 32750),
