(40166, 'ptBR', 'Murlocs na linha', 'Potencialize-se com energia da linha de meridiano encontrada nos Baixios do Murloc.', 'Eu vi esses videspinhas evocando elementais menores, o que não é um feito pequeno para um murloc, mas seu grão-evocador, Blargrrrl, está tentando evocar Torretus do rio.$B$BEu duvido que um mero murloc tenha a capacidade de controlar uma entidade poderosa como o Torretus.$B$BBlargrrrl ficará em êxtase profundo se tentar realizar esse feito. Precisamos de alguma coisa poderosa para interromper o ritual.$B$BPotencialize-se com energias da linha de meridiano e volte aqui.', '', '', '', '', '', '', 32750),
(40161, 'ptBR', 'Sugando do subterrâneo', 'Destrua a Conduíte Videspinha nos Baixios do Murloc', 'Você viu, $n? Aqueles murlocs não são comuns. Eles foram atraídos pelas linhas do meridiano que correm desde Azsuna até esta terra.$B$BDe alguma forma, eles conseguiram drenar o poder de sua corrente arcana para os seus propósitos escusos.$B$BEsses distúrbios precisam acabar para mantermos as linhas do meridiano intactas.', '', '', '', '', '', '', 32750),
(39962, 'ptBR', 'Problemas para Okuna', 'Procure Okuna Presalonga.', '<Você abre a garrafa e encontra uma garrafa dentro.>\n\nSocorro! Preciso de alguém... Mas não de qualquer um. Preciso de um campeão! Finalmente escapei das garras do Príncipe Oceanus só para virar presa do pai dele, Rei Barbafunda.\n\nEstava curtindo minha liberdade e decidi pescar, quando um gigante atacou. Desde então, estou correndo por estas ilhas, tentando evitar aquela criatura... se alguém encontrar esta mensagem, por favor mande ajuda!', '', '', 'Helya', '', '', '', 32750),
(39869, 'ptBR', 'Pedágio para a alma', 'Derrote Helya e liberte os Valarjares.', '[PH] As foretold, you have arrived... Helya is foolish to think I\'ll let her ferry me into Helheim. Odyn has already smiled upon me, my soul belongs in Valhallas. \n\nMake no mistake, I am not a prisoner. Before my death Odyn appeared to me in the form of a raven. He praised my battles in life and gave me a quest no vrykul could refuse. The Helerjar arrived... and I let them slay me.\n\nPrisoner-- nay, I am a liberator, sent by Odyn to free the souls of Valarjar.', '', '', 'Helya', '', '', '', 32750),
(39770, 'ptBR', 'Queimar as duas pontas da vela [NÃO UTILIZADO]', 'Obtenha a Vela Amarela e a Vela Verde.', 'Cê não pode entrar! Precisa vela amarela e vela verde, aí sim cê fala com o Rei das Velas!', '', '', '', '', '', '', 32750),
