(39388, 'ptBR', 'A Sabedoria de Garralua', 'Encontre-se com Thaon Garralua no seu covil.', 'Nossa reação rápida conteve o ataque e salvou o meu vale. Conforme seu pedido, eu me juntarei a Malfurion no Bosque de Cenarius.$B$BAntes, no entanto, eu gostaria de contar algumas coisas sobre os sátiros. São informações valiosas.$B$BEncontre-se comigo no meu covil antes de partir.', '', '', '', '', '', '', 32750),
(39370, 'ptBR', 'Diagrama de Equipamento: Reservas de Munição', 'Leve os diagramas para um Especialista em Equipamento Naval no estaleiro da sua guarnição.', 'Parece um diagrama de equipamento naval. É melhor levar de volta ao estaleiro e ver se alguém consegue decifrar.', '', '', '', '', '', '', 32750),
