(39125, 'ptBR', 'Destruidor de demônios', 'Mate Arauto da Ruína, Zombômago e Sorrilho', 'Algo precisa ser feito contra os demônios que estão espalhando essa corrupção. Se você matar seus generais, todos os planos deles sairão dos trilhos.\n\nTenho um presente para você. Este chifre me foi dado pelo próprio Odyn; use-o para atacar todos que atravessarem o seu caminho.\n\nSe você impedir que a Legião avance, os deuses certamente farão com que o destino sorria para você.', '', '', '', '', '', '', 32750),
(39024, 'ptBR', 'O chamado do arquimago', 'Fale com o Arquimago Hadggar na Torre de Hadggar, em Zangarra.', 'O Arquimago Hadggar planejou a próxima etapa contra o Concílio das Sombras. Vá vê-lo em sua torre, a leste de Talador, no pântano de Zangarra.$b$bNão vai tomar muito tempo.', '', '', '', '', '', 'Fale com o Arquimago Hadggar na Torre de Hadggar, em Zangarra.', 32750),
(39023, 'ptBR', 'O chamado do arquimago', 'Fale com o Arquimago Hadggar na Torre de Hadggar, em Zangarra.', 'O Arquimago Hadggar planejou a próxima etapa contra o Concílio das Sombras. Vá vê-lo em sua torre, a leste de Talador, no pântano de Zangarra.$b$bNão vai tomar muito tempo.', '', '', '', '', '', 'Fale com o Arquimago Hadggar na Torre de Hadggar, em Zangarra.', 32750),
(38839, 'ptBR', 'Esperar Cansa', 'Vá à encosta sul de Val\'sharah e fale com Makra Silvadaga.', 'Mamãe recebeu uma mensagem e falou que sangue se paga com sangue. Ela disse que ia sair e me mandou esperar aqui, mas já passaram duas semanas. Eu estou cansada de esperar.$B$BSó fico em casa se você for procurar. Ela disse que ia para a encosta ao sul.', '', '', '', '', '', '', 32750),
(38697, 'ptBR', 'A Espada da Verdade', 'Deposite a Fal\'shathil no chão e derrote os elfos noturnos de Corvo Negro iluminad$Go:a; por sua luz sagrada.', 'O exército do Senhor Cristacorvo se levantou dos mortos, mas acredito que esteja sob controle de Gul\'dan.$B$BFique com isso, é a espada do Senhor Cristacorvo, a Fal\'shathil. Ela era conhecida por suas qualidades mágicas únicas. Quem se vê refletido na sua lâmina se torna incapaz de negar a verdade.$B$BLeve a espada com você e a finque no chão. Ataque os fantasmas noctiélficos perto da luz. Na presença da espada, talvez eles voltem a si.', '', '', '', '', '', '', 32750),
(38633, 'ptBR', 'Retorno Ardente', 'Salve-se completando uma Masmorra de Caminhada Temporal.', '$gCampeão:Campeã;, você não vai acreditar nos horrores que testemunhei. A linha do tempo está retorcida, e o seu destino é sinistro. A causalidade fraqueja, e, nesse futuro terrível, você se ajoelha diante de ninguém menos que o Traidor, Illidan Tempesfúria. Vá ao passado e se salve, mas cuidado! Os seus poderes vão estar do mesmo jeito que estavam naquela época.', '', '', '', '', '', '', 32750),
(38607, 'ptBR', 'Portões de Valhallas', 'Fale com Vehdir.', 'Escapar das garras de Helya não é pouca coisa. Você pode acabar provando que é $Gum guerreiro digno:uma guerreira digna;, afinal.\n\nSkovald entrou em Valhallas; o seu tempo está acabando. A Legião corrompeu as mentes dos homens de Skovald. Um batalhão de vraikalen indignos está tentando entrar no portal para Valhallas.\n\nOs gigantes que protegem os portões estão lutando em uma batalha que já está perdida. A investida da Legião não tem fim.\n\nFale com Vehdir, o dragão, do lado de dentro dos portões perto do portal. Ele irá ajudar você na sua próxima tarefa.', '', '', '', '', '', '', 32750),
(38598, 'ptBR', 'TEST: Craft Some Legplates', 'Use a sua perícia em ferraria para confeccionar um par de Coxotes Artesanais de Pedra de Meridiano.', 'Os taurens de Alta Montanha confeccionam seus coxotes peça por peça para depois montar tudo.$b$bSe você quer saber minha opinião, parece um trabalho lento e que não precisava ser tão árduo, mas devemos começar por aqui antes de tentar melhorar a eficiência.$b$bTome um pouco de Pedra de Meridiano. Também adicionei a receita ao seu caderno. Vamos tentar e ver o que acontece!', '', '', '', '', '', '', 32750),
(38552, 'ptBR', 'Tumba de Lorde Hal\'shara', 'Saqueie a tumba.', 'A tumba, eu a encontrei.', '', '', '', '', '', '', 32750),
(38304, 'ptBR', 'Val\'sharah', 'Fale com Malfurion Tempesfúria em Lor\'lathil, que fica em Val\'sharah.', '[PH] Atravesse o portal de Dalaran e encontre Malfurion Tempesfúria em Val\'sharah.', '', '', '', '', '', '', 32750),
(38202, 'ptBR', 'Carta: O ataque ao Campo de Testes Goriano', 'Ataque as forças ôgricas no Campo de Testes Goriano, em Nagrand.', 'Os ogros do Campo de Testes Goriano tão incitando campeões contra nossas tropas em Nagrand.\n\nUm ataque bruto ao campo de treinamento deles vai impedir a reunião das forças deles e vai lembrar a eles que não é hora fazer inimizade conosco.', '', '', '', '', '', '', 32750),
(38194, 'ptBR', 'Carta: O ataque ao Campo de Testes Goriano', 'Ataque as forças ôgricas no Campo de Testes Goriano, em Nagrand.', 'Os ogros do Campo de Testes Goriano estão incitando campeões a se voltarem contra as nossas forças, em Nagrand.\n\nUm ataque decisivo ao seu campo de treinamento os impedirá de reunir as forças de que precisarão para nos enfrentar e os fará lembrar que não é bom nos ter como inimigos.', '', '', '', '', '', '', 32750),
(37974, 'ptBR', 'Batalhas de Mascotes Desativadas', '', '', '', '', '', '', '', '', 32750),
(37924, 'ptBR', 'Salvatagem Marítima', 'Marque $1oa depósitos de suprimentos usando bandeiras.', 'Vai ser bem mais rápido se você puder marcar as pilhas maiores de recursos que vir quando estiver eliminando os inimigos.$b$bÉ só fincar uma bandeira que alguém vai direto para lá!', '', '', '', '', '', '', 32750),
