(37749, 'ptBR', 'As Provas de Hadggar: Damas de Ferro', 'Vença o encontro com as Damas de Ferro com as seguintes condições:', 'Derrote seus inimigos mais habilidosos para cair nas graças de Hadggar — e assim, obter recompensas maiores!', '', '', '', '', '', '', 32750),
