(34413, 'ptBR', 'Lumberstruck', 'Protect your peasants as they gather 100 lumber.', '[Test Quest - Do Not Translate]$b$bThis box is empty, begging to be filled with wood.$b$bProtect your peasants as they gather materials from the region.', '', '', '', '', '', '', 32750),
(34244, 'ptBR', 'Levaram meu pai', 'Obtenha as três anotações do Anacoreta Dolruu.', '$p! Tenho uma pista sobre o que aconteceu ao meu pai. Houve relatos de que ele foi visto na presença de orcs do Concílio das Sombras em _____.$b$bMeu pai foi um poderoso anacoreta e tinha vasto conhecimento ancestral. Tremo só de pensar o que os membros do Concílio das Sombras fariam com ele para ter esse conhecimento.$B$BTu poderias ir a ____? capturar os oficiais deles e descobrir o que sabem?', '', '', '', '', '', '', 32750),
(34217, 'ptBR', 'Arrebentar Blon\'sky!', 'Derrote Blon\'sky.', 'Grulk não escolhe mutação. Grulk não ser monstro como Blon\'sky! Blon\'sky ser do mal... escolheu mutação pra ser forte!$B$B$b$bVocê ir pra Grommar? Esmaga Blon\'sky antes que ele machucar inocentes. Faça Grulk feliz!', '', '', '', '', '', '', 32750),
(34213, 'ptBR', 'Eles capturaram meu filho', 'Encontre a Chave da Jaula de Corki e liberte-o.', 'Por favor, $p! Tu podes me ajudar? Recebi um pedido de resgate de um orc muito corrupto e rude da Horda de Ferro.$B$BEle pegou meu filho!$B$BE fez questão de incluir diversas palavras grosseiras para descrever o que aconteceria com meu filho caso o resgate não seja pago. Está claro que ele pensa que meu povo conjura ouro a partir do éter. E se eu tentar resgatá-lo sozinho, ambos seremos mortos.$B$BSerá que tu podes ir a Gron\'mar e resgatar meu filho por mim?$B$BSeu nome é Corki.', '', '', '', '', '', '', 32750),
(33957, 'ptBR', 'Presente para Raa\'la', 'Colete um Bebê Rylak para Raa\'la na Várzea da Ventaneira.', 'Preciso embalar a caça. Eu prometi à minha filha Raa\'la que levaria uma lembrança da caçada para ela.$b$bHá alguns bebês Rylak na caverna perto daqui. Talvez Raa\'la goste de ter um como mascote.$b$bPode pegar um pra mim enquanto eu termino aqui?', '', '', '', '', '', '', 32750),
(33782, 'ptBR', 'Mantenha o equilíbrio', 'Mate Mordetrinca no Arbitum.', 'Veja esses dentes. Essas marcas indicam que os crocoliscos estão sendo subjugados por um dos seus. Quando um crocolisco fêmea cresce demais, passa a dominar seus pares.$B$BÉ meu dever como caçador assegurar que o equilíbrio seja restaurado entre essas criaturas em gratidão pelo sacrifício que fizeram por mim.$B$BEncontra e mata essa fera enquanto cuido dos meus ferimentos. Ela deve estar na outra ponta do Arbitum.', '', '', 'Garrebenta', '', '', '', 32750),
