(33019, 'ptBR', 'NC S1 Q2', '', 'Olá, olá! Eu sou Lin Chao-Wei. Você veio experimentar a famosa sopa de macarrão da minha família? Acho que você está sem sorte. Meu pai se foi antes que pudesse me ensinar a sopa de macarrão com ingrediente secreto. Ele mencionou ter escrito a receita para um amigo dele que foi para o Templo da Serpente de Jade. Talvez você possa encontrá-la lá?', '', '', '', '', '', '', 32750),
