(32458, 'ptBR', 'Com as bênçãos do vento...', 'Coletar Amuletos de Boa Sorte.', '<Um pedido urgente chega aos seus ouvidos.>$b$b$n! A frota do meu pai está chegando a Pandária. Com ventos favoráveis, ela deve chegar a qualquer momento.$b$bOs pandarens têm uma bênção que nos dará sorte com o clima e fará nossos navios chegarem mais rápido à costa. Só precisamos coletar amuletos de boa sorte para isso acontecer.$b$bÀ medida que os navios se aproximarem da costa, precisaremos de menos amuletos. Mas se você tiver bastante, podemos trazê-los para cá imediatamente...', '', 'Uma convocação do príncipe...', 'Anduin Wrynn', '', '', '', 32750),
