(32107, 'ptBR', 'Gourami-tigre voador', 'Leve o Gourami-tigre Voador para Nat Pagle no Cais dos Pescadores.', 'Você pegou um peixe peculiar... com asas. Talvez isso mereça a opinião de um especialista como Nat Pagle, que está sempre no Cais dos Pescadores.', '', 'Talvez Nat saiba mais sobre esse peixe raro.', 'Nat Pagle', '', '', '', 32750),
(32105, 'ptBR', 'Lápide Monumental Impecável', 'Colocar o artefato em exibição.', 'Este artefato foi restaurado e está em excelente condições. Se você o expuser no Trono do Conhecimento, os andarilhos das lendas e arqueólogos poderão estudá-lo.', '', '', '', '', '', '', 32750),
