(31723, 'ptBR', 'Vale dos Quatro Ventos', 'Fale com o Recruta Tem P. Orário no Vale dos Quatro Ventos.', 'Aê, a Floresta de Jade tá passan\' por uma reconstrução violenta, mas o Vale dos Quatro Ventos tá aí pra quem quiser ir lá meter o bedelho. Eu posso te ajudar com tua viagem se cê quiser explorar por aí. Vê aí meus produtos que eu tô com uns equipamento que são mó mão na roda pra quem sai numa jornada.', '', '', '', '', '', '', 32750),
(31685, 'ptBR', 'Vale dos Quatro Ventos', 'Fale com o Recruta Tem P. Orário no Vale dos Quatro Ventos.', 'Aê, a Floresta de Jade tá passan\' por uma reconstrução violenta, mas o Vale dos Quatro Ventos tá aí pra quem quiser ir lá meter o bedelho. Fala comigo quando \'tiver $gpronto:pronta; pr\'eu te dar uma carona pr\'onde cê precisar ir. Fala com meu povo d\'outro lado pra pegar equipamentos que vão ser uma mão na roda na sua brincadeirinha.', '', '', '', '', '', '', 32750),
