(30458, 'ptBR', 'Os batedores retornam', 'Fale com Rell Ventonegro na Aldeia Pinavidro, na Floresta de Jade.', '$n, seus amigos voltaram da missão de reconhecimento. Eles querem falar com você imediatamente.$B$BLamento dizer...$B$BBem, é melhor não dizer nada. Veja por si mesm$Go:a;.', '', '', '', '', '', '', 32750),
(30442, 'ptBR', 'Cerveja explosiva de Blanche', 'Ajude a fazer a Cerveja Explosiva. Se os Barris de Cerveja pegarem fogo, corrija isso!', 'Prepare a Cerveja Explosiva de Blanche protegendo os Barris de Cerveja.', '', '', '', '', '', '', 32750),
(30264, 'ptBR', 'Inimigos nos portões', 'Use uma Serpente dos Céus Shado-Pan para matar 60 atacantes Krik\'thik, 3 Carroças de Guerra Krik\'thik e 3 Catapultas Krik\'thik.', 'Os mantídeos estão atacando em massa a muralha. Consegui umas serpentes aladas para reduzir as forças deles pelo ar.$B$BVocê estaria dispost$Go:a; a tomar as rédeas de uma delas?', '', '', '', '', '', '', 32750),
(30110, 'ptBR', 'PrGMasmorras - Cataclysm - Localizador de Raides - 1ª', '', '', '', '', '', '', '', '', 32750),
(30042, 'ptBR', 'Muito a aprender', 'Fale com o Mestre Shang Xi.', 'No início de seu treinamento, sua primeira tarefa é simples: fale com o mestre Shang Xi.', '', '', '', '', '', '', 32750),
(29895, 'ptBR', 'Na trilha do Peão Branco', 'Mostre o manto ao Almirante Taylor na Aldeia Barbatana de Pérola, que fica na Floresta de Jade.', 'Embora o manto esteja rasgado e sujo, não há dúvida quanto à qualidade da costura e ao selo do Rei.$B$BVocê deve mostrá-lo ao comandante da Aliança.', '', '', '', '', '', '', 32750),
(29744, 'ptBR', '\"Pupilo da natureza\" uma ova!', 'Investigue a Mata dos Perdidos, a nordeste da Pedreira Rocha Verde.', 'Os duendes silvestres não são de ficar vagando, então me surpreende que eles tenham chegado até o distrito dos pedreiros. Deve haver alguma coisa os expulsando do habitat natural deles.$B$BEsses duendes em especial são nativos da Mata dos Perdidos, logo a norte daqui. Eu até iria lá, mas disseram que é assombrada.$B$BEntão... é isso.$B$BNunca saberemos.$B$B<Weng pigarreia.>$B$BOuuuu... $Gum:uma; brav$Go:a; aventureir$Go:a; como você pode ir lá conferir! O que acha?', '', '', '', '', '', '', 32750),
(29715, 'ptBR', 'A bruxa da floresta', 'Encontre An Pelo ao Vento na estrada a norte da Cabana da Bruxa de Jade.', 'Por favor, $r! Pode me ajudar?$B$BAlgumas crianças da aldeia estavam brincando na floresta e não voltaram. Você poderia ficar de olho aberto, se for lá?$B$BEu falei para aqueles moleques deixarem a velha viúva do bosque em paz. Até imagino o que eles estão fazendo... provavelmente estão perturbando ela. Eles acham que ela é uma bruxa.', '', '', '', '', '', 'Encontre An Pelo ao Vento.', 32750),
(29413, 'ptBR', 'O caixote sinistro', '', 'Este caixote foi cobiçado, roubado e vendido. Aqueles que tentaram explorar a magia do caixote viram esse poder se voltar contra si próprios.$B$BE, no entanto, o caixote parece não ter sofrido nenhuma avaria, e continua repleto de energia mágica. De vez em quando ele balança, como se o conteúdo estivesse vivo.$B$BEle parece estar vinculado a você, e agora lhe pertence.', '', '', '', '', '', '', 32750),
