(29174, 'ptBR', 'Quebre a força de vontade deles', 'Mate Gub e o Mestre Chef Gurubashi em Zul\'gurub.', 'Zul\'gurub é como essas árvores altas que você vê ao nosso redor.$B$BO tronco pode ser grosso, e as frondes, vastas e densas, mas sem nutrientes vindos das raízes lá embaixo, a árvore murchará e cairá.$B$BO exército de Jin\'do é alimentado por dois modestos trolls Gurubashi. Parta essas duas raízes e a cidade cairá bem mais facilmente.', '', 'Você deve cortar a linha de suprimentos deles!', 'Gub, Destruidor dos Peixes', '', '', '', 32750),
(29169, 'ptBR', 'As feras de Gurubashi', 'Mate a Rainha da Colmeia Asaflora, uma Cria Perdida de Gahz\'ranka, e Tor-Tun, a Adormecida, em Zul\'Gurub.', '<Maywiki muda de posição, nervosamente.>$B$BDepois da queda de Hakkar, a cidade dos Gurubashi ficou em ruínas e a selva acabou tomando conta da maior parte de Zul\'gurub. Várias feras poderosas agora moram nas rachaduras e recessos da antiga cidade.$B$BNós já vimos o poder que os sacerdotes Gurubashi têm. Eles fazem a própria flora do lugar se voltar contra nós com seus preparados venenosos! Por favor, heróis, deem cabo dessas feras antes que elas se tornem agentes de Jin\'do e dos seus lacaios!', '', 'Não podemos deixar os Gurubashi controlá-las!', 'Rainha da Colmeia Asaflora', '', '', '', 32750),
(29091, 'ptBR', 'Liberdade de ir e vir', '', '', '', '', '', '', '', '', 32750),
