(29029, 'ptBR', 'Antes que o conhecimento se perca', 'Leve o cantil cheio a Andalar Valumbra.', '<A água corrompida borbulha e espuma, como se tentasse libertar-se de si mesma.>$b$bLeve esta água ao nosso batedor em campo. Ele deve conseguir purificá-la para nosso ataque à fortaleza do Concílio!', '', '', '', '', '', '', 32750),
