(28743, 'ptBR', 'Artilheiro de cauda!', 'Derrube 15 Reco-recos de Schnottz.', 'Você está a fim de uma pequena caça, $n?$b$bSuba a bordo! Eu piloto e você atira!', '', '', '', '', '', 'Fale com Harrison Jones no Dique Vir\'naal.', 32750),
(28601, 'ptBR', 'Velho Moroso', '', '', '', '', '', '', '', '', 32750),
(28516, 'ptBR', 'Séculos de sofrimento', 'Fale com o Espírito Kaldorei no centro do Lago Kel\'Theril.', 'Eu só concordei em considerar trabalhar com os elfos noturnos e a Aliança por causa dos rumores de que o Cristal de Zin-Malor havia sido encontrado aqui.$B$BO cristal é um artefato poderoso e antigo, cuja destruição amaldiçoou esta terra, e a sua remontagem não trouxe grande alívio.$B$BMas não consigo encarar as assombrações que aqui habitam. Pode zombar de mim se quiser, mas faça algo por conta própria antes. Talvez os espíritos serenos que ficam no centro do lago queiram falar com você...', '', '', '', '', '', '', 32750),
(28365, 'ptBR', '<PH>Chuvisco seguro', '', '', '', '', '', '', '', '', 32750),
(27946, 'ptBR', 'NYI', '', '', '', '', '', '', '', '', 32750),
(27018, 'ptBR', 'The Herald <NYI>', '', '', '', '', '', '', '', '', 32750),
(26893, 'ptBR', 'Profundezas Negras', 'Fale com Je\'neu Sancrea.', '$C, você é a pessoa ideal para a tarefa que tenho em mãos. Precisamos defender a região em torno das Profundezas Negras para lidar com as forças da Aliança que ameaçam o Assentamento Zoram\'gar, a oeste daqui.$B$BVá para as Profundezas Negras, a norte do Assentamento Zoram\'gar, e fale com Je\'neu da Harmonia Telúrica. Ele tem muito trabalho para você.', '', '', '', '', '', '', 32750),
(26839, 'ptBR', 'Se afaste disso tudo!', 'Visite a Espoleta Chaveforte no Esconderijo da Chaveforte, que fica no Cabo do Espinhaço.', 'Diga-me, $c, você parece tão cansad$go:a;. Carregando o tempo todo essa carteira pesada... Quer dizer, equipamento pesado... Você já deve estar com as suas costas de $r doloridas.$b$bA Espoleta Chaveforte acabou de inaugurar um resort cinco estrelas na deslumbrante costa do Cabo do Espinhaço. Viagens de balão, barcos a remo, viagens diárias até Angra do Butim... Eles têm de tudo.$b$bVocê devia mesmo ir visitá-los. Dá pra dizer só de olhar pra você que está na hora de descansar um pouco depois de tantas aventuras difíceis e lucrativas.', '', '', '', '', '', 'Visite a Espoleta Chaveforte no Esconderijo da Chaveforte, que fica no Cabo do Espinhaço.', 32750),
(26837, 'ptBR', 'A escavação da Liga dos Exploradores', 'Apresente-se a Bronwyn Talho na Escavação da Liga dos Exploradores, que fica no Cabo do Espinhaço.', 'Então, $n... Você me parece capaz.$b$bBronwyn Talho, da Liga dos Exploradores, tem procurado recrutas para ajudar na escavação do Cabo do Espinhaço. Na verdade, não entendo por que ele não vai até a Angra do Butim e contrata alguns bucaneiros... Os piratas são facilmente atraídos por algumas peças de ouro.$b$bBom, de qualquer jeito, dizem por aí que ele finalmente encontrou alguma coisa importante naquela selva. Mas o que será?', '', '', '', '', '', 'Apresente-se a Bronwyn Talho na Escavação da Liga dos Exploradores, que fica no Cabo do Espinhaço.', 32750),
(26767, 'ptBR', 'Como cumprir missões', 'Cumpra uma missão de encaminhamento.', 'Oba! Você vai poder cumprir uma missão de encaminhamento! Agora, descubra qual é o próximo passo.', '', '', '', '', '', '', 32750),
(26741, 'ptBR', 'REUSE', '', '', '', '', '', '', '', '', 32750),
(26379, 'ptBR', 'Socorro aos refugiados', 'A Sentinela Leandra, em Lor\'danel, quer que você fale com a Sacerdotisa Alinya no Acampamento de Refugiados.', 'Espero que tenha vindo para nos socorrer. Você não faz ideia do que estou falando, não é?$B$BNão tenho tempo para explicar tudo, mas, escute, tínhamos uma cidade na Costa Negra, Auberdine, um dos lugares que mais sofreu com o Cataclismo. Estamos resgatando os sobreviventes, mas preciso de alguém mais experiente, como você, para verificar rumores sobre a existência de um acampamento de refugiados ao sul.$B$BDeixe o norte por nossa conta. Viaje para o sul imediatamente e ajude os refugiados em tudo que for possível.', '', '', '', '', '', '', 32750),
(26243, 'ptBR', 'O Pilar do Mundo', 'Pergunte a Maruut Atapedras sobre o Pilar do Mundo.', 'O pilar neste salão não sustenta apenas o Templo da Terra.$B$BTodo este plano da existência desabará sobre o nosso mundo se não conseguirmos reconstruir a estrutura.$B$BEm breve será hora de agir, $n. Mas antes, você precisa ouvir o que tenho a lhe dizer.', '', '', '', '', '', '', 32750),
(25506, 'ptBR', 'Cadeia alimentar marinha', 'Encontre um Filhote de Baiacu no Ossário do Roedor e leve-o para o Abismo, próximo aos Currais.', 'O nosso tempo aqui está se esgotando.$b$bPreciso descobrir uma forma de atravessar o abismo e descobrir o propósito por trás das atividades das nagas aqui.$b$bSe você vai me seguir, seria sábio concluir a sua busca por uma montaria adequada antes.$b$bProcure na área ao norte daqui e encontre um filhote de Baiacu. Quando conseguir capturar um, leve-o para a trincheira a oeste. Prepararei tudo que você precisa por lá.', '', '', '', '', '', '', 32750),
(25497, 'ptBR', 'De volta ao comando', 'Use 6 pedaços de Carne de Tartaruga para criar uma Isca de Tubarão.', 'A nossa situação está começando a ficar um pouco desesperada, $r.$b$bPrecisamos concentrar a nossa atenção nas nagas e nos prisioneiros delas, mas seria tolice fazermos isso sem estarmos preparados – o que, por aqui, significa encontrar algum jeito de viajar com maior velocidade.$b$bEsses tubarões claramente apreciam tartarugas marinhas. Vamos ver se conseguimos usar isso a nosso favor.', '', '', '', '', '', '', 32750),
(25474, 'ptBR', 'Once More, With Eeling [DEPRICATED]', 'Kill 15 of any Eel in the Kelp Forest.', 'Eels are among the creepiest of Azeroth\'s creatures.$b$bSure, there are those who pretend that they don\'t mind them - and others who actually claim to favor them.$b$bThey are lying.$b$bTruth be told, no one likes eels. Eels don\'t even like eels.$b$bAzeroth would be a better place if no one ever had to envision an eel slithering out from the murky depths and biting them.$b$bIn the face.', '', '<...wretch.>', 'An Eel', '', '', '', 32750),
(25435, 'ptBR', 'A pressão está aumentando', 'Colete 3 Tendões de Tubarão de Manguazes Vorazes e 2 Pinças de Caranguejo Afiadas de Siris Garra-de-sabre.$b$bManguazes Vorazes também podem ser evocados usando Entranhas de Caranguejo.', 'Bom dia, $grapazinho:mocinha;.$b$bO nome é Rendel.$b$bParece que a velha Moana e eu chegamos na última hora, né?$b$bErunak não tava brincando quando disse que era vida ou morte!$b$bEnquanto ele tá tentando achar um lugar seguro para nos enfiarmos, vou tentar arranjar um caranguejo para você montar.$b$bPosso não estar por dentro dos pormenores da vida no mar, mas tive a impressão de que as nagas sabem se mover por aqui.$b$bVocê vai pegar alguns trecos para um bridão e vou preparar um encantamento.', '', '', '', '', '', '', 32750),
(25384, 'ptBR', 'Materiais brutos', 'Samir quer que você colete 3 Pedaços de Metal Fundido das Orcas Enfurecidas que estão na Floresta Kelp\'thar.$b$bVocê pode atrair uma orca usando as Entranhas de Tenaz das Tenazes Cliquestala.', 'Obrigado, $c. Devemos a você as nossas vidas.$b$bMas, para que tornemos a ver a superfície, teremos que abrir caminho lutando. Isso quer dizer que terei que fabricar algumas armas e armaduras.$b$bAntes de você me encontrar, vi um soldado ser devorado por uma daquelas orcas.$b$bAposto que, se você cortar algumas delas, vai encontrar bastante sucata útil.$b$bSe você não quiser nadar até onde elas estão, aposto que você poderia atrair uma delas com um pouco de vísceras...', '', '', '', '', '', '', 32750),
(25305, 'ptBR', 'Jamais olhe para trás', 'Mate 10 Nagas Cristafúria e seu líder', 'Nosso acampamento na Ilha de Sardor foi perdido para as nagas Cristafúria. Esmagados por seu contingente, voltamos à terra firme. Enquanto elas vibravam com seu recém-conquistado banco de areia, levantamos o Domínio de Plumaluna na costa e reunimos um exército ainda maior.$B$BAgora, as Cristafúria serão expulsas para o mar. Fale com a sentinela Ranadae para unir nossas forças em Sardor. Mate as nagas e certifique-se que qualquer serpente asquerosa no comando também seja morta.', '', '', '', '', '', '', 32750),
