(14169, 'ptBR', 'Mortos de fome', 'Arranje um Pão dos Mortos e entregue-o para o Espírito Draenei Alegre, no cemitério da Exodar.$B$BUse um Cravo-de-defunto Laranja para enxergar o espírito.', 'É um prazer passar um tempo com os amigos e a família, mas acho que exagerei... Já comi tudo que foi feito para mim!$B$BTu poderias trazer-me mais alguns deliciosos pães dos mortos? Eu te agradeceria muito...$B$BAcho que o Chapa vende a receita.', '', '', '', '', '', '', 32750),
(12480, 'ptBR', 'Para Nortúndria!', 'Fale com o Recrutador da Horda na Fortaleza Brado Guerreiro, que fica na Tundra Boreana, ou com o Recrutador da Horda que fica no Porto Vendeta no Fiorde Uivante.', '$gBem-vindo:Bem-vinda; à Versão Alfa para Amigos e Família do Wrath of the Lich King. Use os portais ao lado para iniciar sua jornada por Nortúndria.$B$BVocê pode se apresentar ao recrutador da Horda na Fortaleza Brado Guerreiro, que fica na Tundra Boreana, ou você pode ir para Porto Vendeta no Fiorde Uivante.', '', '', '', '', '', '', 32750),
(11622, 'ptBR', 'Segredos de Quebramar', 'Encontre Veehja nas ruínas do Quebramar, na Tundra Boreana.', 'Existe alguém que pode nos dar uma luz quanto a este mistério, $r. Dizem que os kvaldir mantêm viva uma sacerdotisa naga no templo que fica no lado leste da costa.$B$BSem dúvidas, ela guarda rancor de seus visitantes não convidados. Talvez meu pai acredite que ela colabore com você de alguma maneira.', '', '', '', '', '', '', 32750),
(11404, 'ptBR', 'Chame o Cavaleiro Sem Cabeça', 'Leve uma Vela Lúgubre até o Solo Levemente Revirado.', 'Velas lúgubres adornam este altar da abóbora, que parece sorrir ameaçadoramente...', '', '', '', '', '', '', 32750),
(11179, 'ptBR', '[Temporarily Deprecated Awaiting a New Mob]Finlay Is Gutless', 'Collect 7 Pristine Mistsaber Catgut for Finlay Fletcher and return to him at Westguard Keep.', 'All these crossbowmen, and who is it that has to maintain all of their weapons? Me, Finlay Fletcher!$B$BThe commander commandeered my assistant to get ready for the move up to Fort Wildervaar, and I haven\'t the time to go out and get all of the catgut that I need for their strings!$B$B$C, be a good $g lad : lass; and gather me up some catgut. The mistsabers prowling about the fjord will do, but mind that you only bring back the most pristine of intestines from them! Severed gut won\'t do us any good.', '', '', '', '', '', '', 32750),
(10187, 'ptBR', 'Uma mensagem para o arquimago', 'Fale com o Arquimago Vargoth, no topo da Torre Violeta, em Eternévoa.', 'Embora as coisas estejam consideravelmente sombrias por aqui, ficamos bastante emocionados ao ouvir que o arquimago não se esqueceu dos problemas da vila.$B$B<O zelador fita a torre.>$B$BNão é ridículo? De vez em quando parece que o que nos separa é uma simples parede de pedra. A parede mágica é fácil de esquecer.$B$BPor gentileza, suba na torre e avise ao Arquimago Vargoth que estamos progredindo aqui na vila e que em breve teremos um plano para afastar as criaturas de mana.', '', '', '', '', '', '', 32750),
(10179, 'ptBR', 'O zelador de Kirin\'Var', 'Fale com o Zelador Dieworth, na Vila Kirin\'Var, em Eternévoa.', 'Quando ficou claro que nossa expedição estava presa em Terralém sem meios de retornar a Azeroth, o contingente do Kirin Tor viajou até as Planícies de Farahlon e construiu a Vila Kirin\'Var. Deixei a administração da cidade nas mãos do Zelador Dieworth, mas, quando Kael\'thas e suas forças selaram-me na Torre Violeta, perdi o contato com o zelador.$B$BProcure-o na Vila Kirin\'Var e ajude-o como puder, $n. Estou certo de que ele está bastante atarefado com as sequelas do ataque.', '', '', '', '', '', '', 32750),
(9988, 'ptBR', 'O melhor amigo do janota', 'Traga 30 Penas de Arakkoa para Ros\'eleth, na Fortaleza Alleriana.', 'Não deixe que Thander e companhia o enganem. Eles podem parecer um bando de temíveis guerreiros, mas debaixo daquele aço todo não passam de um bando de janotas!$B$BVocê não os verá em público sem os chapéus. Os extravagantes chapéus são feitos com feltro e peles, e adornados com as penas mais berrantes que você jamais viu.$B$BAs penas mais cobiçadas vêm, obviamente, dos arakkoas, e meus suprimentos estão ficando escassos. Pago com prazer, se você as coletar para mim.', '', '', '', '', '', '', 32750),
(9984, 'ptBR', 'Anfitrião da cidade secreta', 'Leve as Ordens de Luanga para Andarl. Você pode encontrá-lo na Fortaleza Alleriana, na Mata Terokkar.', 'Embora você não consiga ler os estranhos escritos no pergaminho, o símbolo ornado na parte inferior do documento indica que ele foi escrito por um arakkoa de alto nível. Luanga pode ter planejado a captura e a interrogação de Deirom, mas parece que ele estava sob ordens de outra pessoa.$B$BVocê lembra que Thander mencionou que Andarl estudou os arakkoas. Talvez ele possa decifrar os escritos do pergaminho.', '', '', '', '', '', '', 32750),
(9491, 'ptBR', 'Greed', 'Eralan in Tranquillien wants you to retrieve the Pitted Gold Band from the Amani Catacombs.', 'A rich, and I mean filthy rich, merchant came through here yesterday talking about some ring of \"immense archeological importance\" locked in one of the countless burial chests found in the Amani Catacombs. When he wasn\'t talking about the ring, he was talking about how much he\'d pay for it.$b$bTell you what, I\'ll front the thieves\' tools, and if you manage to bring the ring back, I\'ll pay you enough to buy ten rings of your own!', '', '', '', '', '', '', 32750),
(9025, 'ptBR', 'A descoberta de Morgado', 'Fale novamente com Aristeu Motta em frente ao banco, no Distrito Comercial de em Ventobravo.', 'Ora, vejam só! Parece que o Aristeu não estava completamente enganado. Eu encontrei traços de substâncias usadas em poções do amor e bebidas que alteram a mente.$b$bNão é de todo incomum que perfumes tenham um pouco dessas substâncias, mas algum dos ingredientes que encontrei.. não me cheiraram bem.', '', '', '', '', '', '', 32750),
