(6401, 'ptBR', 'Kaya\'s Alive', 'Tell Tammra Windfield in Sun Rock Retreat the good news.', 'Tell Tammra Windfield, Kaya\'s aunt who\'s at Sun Rock Retreat, about the good news! Kaya is alive! We had thought she was lost after the brutal attack on our village. Follow the path to the west to get to Sun Rock Retreat.', '', '', '', '', '', '', 32750),
(4967, 'ptBR', 'Knowledge of the Orb of Orahil', 'Speak to Menara Voidrender in the Barrens.', 'Still a fool, and still seeking the trappings of mortals. Yes, I speak to you with arrogance. I see you before me and I laugh. You\'re pathetic!$B$BBut it matters not what I think. It only matters what those willing to deal with you thinks! And in this case, against my better judgment, those with some portion of power feel you deserve more.$B$BIf this is something you strive for then you should speak with Menara Voidrender in the tower above Ratchet. I believe you have met her before some time ago.', '', '', '', '', '', '', 32750),
(4782, 'ptBR', 'Components for the Enchanted Gold Bloodrobe', 'Return to Menara Voidrender in the Barrens.', 'Return to Menara, tell her it\'ll take some time, but I\'ll make sure to come through for her... and you. Tell her to have you finish gathering the rest of your components--I should have the thread done by then. You can return and pick it up then.$B$BGood luck, $n. Oh, and say hello to Strahad for me while you\'re there. That old coot... putting a tower right there next to Ratchet... crazy.', '', '', '', '', '', '', 32750),
(4737, 'ptBR', 'In Search of Menara Voidrender', 'Speak to Menara Voidrender in the Barrens.', 'Hmph, still you strive to become more powerful. I say it\'s only time before the corruption and addiction takes hold of you and you become a slave to that which you seek to gain power over.$B$BPfah! A fool you are! Time will prove me right--nothing else... just time.$B$BBut it seems that not all agree with Zevrost. It seems Menara would create tools for you to become more powerful and to harness your strength. If you\'re interested, then go to Ratchet in the Barrens. She is there overlooking the town.', '', '', '', '', '', '', 32750),
