(3086, 'ptBR', 'Glyphic Tablet', 'Read the Glyphic Tablet and speak with Mai\'ah near the entrance to the Den in the Valley of Trials.', 'Ah, while you were gone a tablet came for you, $n.$B$BRead it when you have time. If I\'m not mistaken, it came from the mage trainer Mai\'ah. She would have words with you when you\'re ready.', '', '', '', '', '', '', 32750),
(3064, 'ptBR', '<NYI> <TXT> Pirate Hats', 'Bring 20 Untorn Pirate Hats to Yorba Screwspigot.', 'I need pirate hats for my shop.  Get me lots!', '', '', '', '', '', '', 32750),
(2996, 'ptBR', 'Seeking Strahad', 'Speak to Strahad Farsan in Ratchet.', 'I have taught you skills in the past, but the time has come for another to teach you. He is in Ratchet, and his name is Strahad. He is human, but do not let that fool you into thinking he is weak. He is powerful even though he may be small. He can teach you about more powerful summonings--I feel you are ready. Go to him now. He is in Ratchet... above the port town next to his tower.', '', '', '', '', '', '', 32750),
(1803, 'ptBR', 'Tome of the Cabal', 'Retrieve the Moldy Tome and Tattered Manuscript for Jorah Annison in the Undercity.', 'Ah! I see that you are a warlock of similar tastes to mine. Indeed, acquiring the Tome of the Cabal is a worthy aspiration. Did you know that it was once held within the walls of Lordaeron? It was vandalized though, almost half its pages removed. Who would commit such a heinous act?$b$bThat half is lost, though rumor says that it fell into the hands of the centaur of the Thousand Needles.$b$bThe rest of the text was to be transferred to Ironforge, but was lost in transit on the coast west of Southshore.', '', '', '', '', '', '', 32750),
(1514, 'ptBR', 'Botão Selvagem corrompido', '', '', '', '', '', '', '', '', 32750),
(1510, 'ptBR', 'News of Dogran', 'Speak with Ken\'zigla at the Malaka\'jin.', 'He was stationed at Camp Taurajo, where we\'ve been trying to weed out the quilboar. He led a few grunts to one of their camps, where he was hurt bad. The others made it back and tried to rescue him. He was in bad shape, his wounds festered, so they were afraid to move him without patching him up first.$b$bThey sent a message here, requesting a healing draught from the trolls at the Malaka\'jin at the base of the Stonetalon Mountains. We sent someone to get it, but they haven\'t returned yet.', '', '', '', '', '', '', 32750),
(1476, 'ptBR', 'Hearts of the Pure', 'Bring the hearts of Dalin Forgewright and Comar Villard to Carendin Halgar in the Temple of the Damned.', 'Men of honor and goodness? Does such a man exist?$b$bIt took much research, but through bits of overheard stories, I managed to find two men that should do.$b$bThe first is Dalin Forgewright, who has dedicated himself to the care of the Lordaeron refugees, whom are refused by their kin at the Greymane Wall.$b$bThe other is Comar Villard, a man who remains faithful to his lost love, wandering the Wetlands for a sign of his wife.$b$bDeliver their hearts to Carendin. But first, let me show you your quarry.', '', '', '', '', '', '', 32750),
(1265, 'ptBR', 'The Missing Diplomat', 'Search Sentry Point for any sign of Private Hendel.', 'Hendel? Yes, I know the man. But why would you need one of my soldiers?$B$BElling sent you to find him? Hmm, I don\'t like the sound of that. Elling wouldn\'t have you come to me first if your business wasn\'t troubling. I understand if you can\'t tell me what this is about, but know this: I have a duty to protect these lands. If you\'re going to cause a disturbance, then I suggest you inform me of whatever you can.$B$BI believe Hendel was stationed at the first tower outside of Theramore. Be cautious.', 'Sentry Point explored', '', '', '', '', '', 32750),
(1264, 'ptBR', 'The Missing Diplomat', 'Find Commander Samaul in Dustwallow Marsh.', 'The beginning of every month the Kul Tiras Marines all get paid and usually leave Theramore for somewhere else. A lot of them come here to womanize, carouse, and just have a good time. One of those groups I\'d consider regulars here at the tavern, and I believe this Hendel is among them.$B$BCommander Samaul in Theramore would be able to help you find him if Hendel\'s still stationed there. He\'s completely loyal to Proudmoore, but if you drop Elling\'s name, he should help you out... discreetly.', '', '', '', '', '', '', 32750),
(782, 'ptBR', 'Broken Alliances', 'Kill Boss Tho\'grun and bring the Sign of the Earth to Gorn in Kargath.', 'From the Horde\'s alliance with the dragon Deathwing during the Second War, we know that two of his lieutenants, Blacklash and Hematus, were imprisoned within Lethlor Ravine far to the east. We must silence our depraved allies of old to restore honor to the Horde!$B$BWe hired Tho\'grun and his band of ogre mercenaries to help us obtain the Sign of the Earth, a key needed to unlock the drakes\' prison. Tho\'grun betrayed us though, overwhelming us and taking it for himself. Go to Camp Boff and take it back!', '', '', '', '', '', '', 32750);
